INSERT INTO `bec_comments` VALUES (1,12,'what is the password for the vimeo video?','2015-02-05 22:46:31',170,'162.209.1.123',1),(2,12,'Password: crowd','2015-02-06 14:13:29',114,'162.209.1.123',1),(3,10,'Nice work Pivot team!!!','2015-02-06 14:48:40',175,'162.209.1.123',1),(4,10,'Brilliant idea and solution!','2015-02-06 15:05:43',179,'162.209.1.123',1),(5,10,'This would be a great MVP project to run as a quick stand-alone app that could be incorporated into the full Target app later.','2015-02-06 18:15:42',197,'162.209.1.123',1),(6,13,'It would be awesome if we could work with a celebrity chef like Giada to create the menu items!','2015-02-06 19:47:01',249,'162.209.1.123',1),(7,21,'I like the concept of the idea because it brings people to the stores and it continues our connection to the communities.  What would be interesting is how you create events that celebrate the community and tie them back to purchasing at Target.  ','2015-02-06 19:59:28',106,'162.209.1.123',1),(8,20,'I like the integration of price into this equation and all of the filters you put in around food you want included, how long it takes to cook, etc...','2015-02-06 20:02:52',106,'162.209.1.123',1),(9,18,'I like the concept of what this could do and the long term tracking it would include.  How would you plan to integrate food or food spending that happens outside of Target, would it have that capability?','2015-02-06 20:06:41',106,'162.209.1.123',1),(10,17,'I like the ability to have everything you need for a week in one box without having to go find it across the store.  I also like the idea of the interactive portion with online videos and the kiosk. ','2015-02-06 20:09:07',106,'162.209.1.123',1),(11,18,'Using the barcode scanner, guest should be able to scan items outside of store and add to their lists.  In addition, for items that are not recognized, guests could select one of the 6 categories.  The list function on Target.com and mobile allows guest to add to lists through scanning and typing. ','2015-02-06 20:15:09',200,'162.209.1.123',1),(12,22,'I like this because it removes the barrier of price from the equation to start and then creates a game out of it to continue to try more products.  My only question is around the next time when the lemon is not 20% off, do they still go to it?  Does just trying Organic cause you to make the switch?','2015-02-06 20:20:06',106,'162.209.1.123',1),(13,15,'I think kids would like this if you set up the right incentive plan for them.  My kid spends hours reading to get to the next level on a simple app.  The difficulty might be in creating that right incentive and getting the consumer to understand how it all works.  ','2015-02-06 20:23:33',106,'162.209.1.123',1),(14,13,'I like this idea because you have connected the whole process from planning to shopping to preparing.  The way it auto-creates the list is great and includes savings from Cartwheel.  ','2015-02-06 20:28:38',106,'162.209.1.123',1),(15,12,'Compared to the other recipe ideas out on this site, I like your focus on connecting with social media to create the recipe and the order at Target','2015-02-06 20:35:18',106,'162.209.1.123',1),(16,23,'I like the connection between activity and savings.  It would be interesting to understand how much savings you would need to make this important.  Maybe you could achieve % off levels on certain products instead and have it be pick and choose like Cartwheel.  ','2015-02-06 20:37:18',106,'162.209.1.123',1),(17,13,'Enhance this experience by having a drive through Pharmacy window that they can pick up the goods at (along with all their Rx prescriptions!).  Perhaps choosing healthy meals can award the guest more rewards points, too. Love the idea of a scheduled pickup time to preserve freshness, too!  Nice work','2015-02-06 21:10:27',292,'162.209.1.123',1),(18,31,'Video password:  crowd','2015-02-06 21:29:03',190,'162.209.1.123',1),(19,25,'Love the concept.  Perhaps we could partner with \"Map My Run\" or \"Fitness Pal\" who already has a strong following and can incorporate the point system.  Could this app incorporate a calorie counting system? ','2015-02-06 21:55:14',317,'162.209.1.123',1),(20,22,'Love this idea!','2015-02-06 22:22:43',343,'162.209.1.123',1),(21,13,'This experience feels separate from her regular Target shopping trip. How could they be connected or interwoven? How can you use Pinterest, where Target already posts recipes, to connect to this?','2015-02-07 14:47:17',371,'162.209.1.123',1),(22,12,'How can we make this experience possible for our Pfresh guests?','2015-02-07 14:53:04',371,'162.209.1.123',1),(23,22,'I am such a huge fan of this!  What a wonderful idea to get good product in more hands and also help protect the environment.','2015-02-08 21:33:14',385,'162.209.1.123',1),(24,10,'Nice idea. It would be great, if we implement this.','2015-02-09 03:12:03',13,'162.209.1.123',1),(25,25,'agree with Chad!  I already record my calories and activities in 2 other apps, so if this one would just hook in to those, it would be a no brainer.','2015-02-09 13:33:01',394,'162.209.1.123',1),(26,13,'I think this is a fantastic idea.  I could see myself using the app at the end of the work day to select the meal and if the pick up in store option could include a pick up time of 20 minutes out then I would stop by my Target on my way home and grab the items for dinner that night.','2015-02-09 14:15:38',401,'162.209.1.123',1),(27,12,'What i like about this is ease - inspiration added to shopping list and customize if need be and pick up in store','2015-02-09 14:19:29',410,'162.209.1.123',1),(28,31,'Will this negatively impact TCOE as people trade off investing in their communities for investing in their own savings? How about considering a match? Would that make the financials non-viable?','2015-02-09 14:33:17',416,'162.209.1.123',1),(29,13,'Strong idea but think the connection to uploading the list and Cartwheel is where it really becomes an optimal experience.  ','2015-02-09 14:39:42',440,'162.209.1.123',1),(30,31,'I like the seamless connectivity to REDcard but worry that 1% may not be enough for even our most loyal guests.  Perhaps escalating contributions or bonuses if you reach a certain threshold for the year would entice it a bit?','2015-02-09 14:46:24',430,'162.209.1.123',1),(31,12,'I love the fact that you can pick a recipe from pinterest and send it to your shopping cart then go pick up the ingredients! That would save working families so much time for suppers. Just swing in after work and grab all the ingredients for a meal! Amazing concept! ','2015-02-09 14:50:58',459,'162.209.1.123',1),(32,13,'The first thing I thought of was the Archer Farms Mix and Match meals.  Although this is a pre-prepped meal, I wonder if insight from how the guests use these meals with their family?  Do guests need to make their own food or are they looking for an easy way to grab and go?  ','2015-02-09 14:57:02',462,'162.209.1.123',1),(33,34,'This concept could be even better if this wellness quiz differentiated from others. For example, I feel confident any wellness quiz is going to tell me to eat healthy & exercise less.  Perhaps by tying the wellness events to a game? Or points to keep me motivated to do things I know I need to do.','2015-02-09 15:01:57',462,'162.209.1.123',1),(34,25,'Along the same lines as Bryn & Chad, it would also be convenient if the app could track foods you repeatedly eat/prepare for your family based on data you enter and then show you a more \"custom\" list of food discounts based on those frequent foods.','2015-02-09 15:08:07',490,'162.209.1.123',1),(35,12,'I love this idea. There used to be an app called Zip List that had similar functionality.  I miss it dearly, this idea takes what was great about that app many steps farther by allowing me to put items in my cart and pick them up.  A huge time saver for the busy mom!','2015-02-09 15:10:02',461,'162.209.1.123',1),(36,12,'The things I really enjoyed about this concept is that it takes recipes, creates lists, and gives me the totals of the items - this takes a lot of guess work out of the recipes.  I run into issues with TGT not having items, ie figs.  Perhaps this app can be linked to store availability, too.','2015-02-09 15:34:23',462,'162.209.1.123',1),(37,13,'Love this idea - just not the name.  Target Chef sounds like you could have prepared meals delivered vs cooking for yourself/family.','2015-02-09 15:38:10',542,'162.209.1.123',1),(38,42,'Outstanding idea, the personalization concept really makes the experience relevant to each user.  Of note, \"be well\" is a tagline used by Walgreens, but the concept is truly innovative and allows the user to get what they want from Target to meet their personal goals.','2015-02-09 15:50:41',556,'162.209.1.123',1),(39,42,'This concept might be more appealing if it was integrated with Cartwheel, something the guest may already be using.','2015-02-09 15:52:50',542,'162.209.1.123',1),(40,31,'Would it be possible for the card holder to identify what % of the purchases get contributed to the 529 plan.  Target Credit Union could help provide consulting on which state plans to select and provide guidance on investment options.','2015-02-09 16:02:40',422,'162.209.1.123',1),(41,42,'simple and direct - could easily tie in to Cartwheel (for incentives) and connect them to a broader community. I like the personalization -- i assume it could also be localized? how could we integrate our community partners into the solution?','2015-02-09 16:02:53',75,'162.209.1.123',1),(42,42,'I love the customized experience for each person, recognizing that we all have different goals!','2015-02-09 16:08:14',590,'162.209.1.123',1),(43,41,'great!','2015-02-09 16:08:23',144,'162.209.1.123',1),(44,10,'i would definitely use this function in the Target App. Great idea!  Great work.','2015-02-09 17:03:51',644,'162.209.1.123',1),(45,40,'I love this idea, would be great to extend it a little further - if you push out the recipes, could the guest select the items they want from the recipes (like a checklist) pay for it online and pick up in store so it would be ready for her to take home and prepare?','2015-02-09 17:18:41',679,'162.209.1.123',1),(46,22,'Great way to identify the barrier and put a concept against the price issue.  Love the simplicity and ease of use of this idea. ','2015-02-09 17:21:53',440,'162.209.1.123',1),(47,43,'How can you/might you make this idea beneficial to the consumer when they shop & interact outside of Target? How might you invent other companies outside of Target to participate? How can it be a win + win + win?','2015-02-09 17:31:51',30,'162.209.1.123',1),(48,22,'Even lowering the premium from 50% to 20% is a sizable upcharge is we want to affect year-round buying habits. A low-budget family spends $7,500/year on food (s: USA Today), equating to an extra $1500/year.  Maybe we use Cartwheel to remove the premium if purchase is combined w/ margin-rich product.','2015-02-09 17:38:47',354,'162.209.1.123',1),(49,13,'Nice idea. I think marketing it to the mom is too limiting (dads are also responsible for meals) and the app should allow for sharing not only of content but of responsibility between two adults to make it truly beneficial.','2015-02-09 18:40:20',101,'162.209.1.123',1),(50,22,'As a consumer I like this idea, as a target employee, I wonder how this will help us grow our profitable business? I like the idea of taking prices down, but will this truly be sustainable? I think more cost/profit analysis will be good to see.','2015-02-09 18:54:57',395,'162.209.1.123',1),(51,30,'lll','2015-02-09 18:59:42',141,'162.209.1.123',1),(52,30,'lll','2015-02-09 18:59:55',141,'162.209.1.123',1),(53,36,'I love this idea.  I could easily see ordering this meal, but with each ingredient allow the option to upsize.  Mock example:  The meal requires 1 cup milk, 1 orange, and 2 chicken breasts.  Allow the user to select ordering a full gallon of milk and 1 lb of oranges.','2015-02-09 19:06:19',784,'162.209.1.123',1),(54,36,'Love this idea! Especially the part about not having to think about what to make, just simply choose from a list of healthy options! I can see this  becoming a very popular choice with busy moms quickly! ','2015-02-09 19:21:02',786,'162.209.1.123',1),(55,42,'I like that this concept thinks outside the \"food\" wellness box and more broadly at wellness.  ','2015-02-09 19:33:22',778,'162.209.1.123',1),(56,25,'I like the idea of using something, map my run/fit bit/existing programs, to help with accountability.  As someone who is not great with meal planning, anything that could help generate a grocery list that has overlap with multiple recipes would be nice.','2015-02-09 19:46:57',823,'162.209.1.123',1),(57,40,'@dawn.condon, thanks for commenting!  Yes, that is the idea.  The guest would be able to push all or some of the ingredients from the recipes directly into her shopping cart.  She would pay for all items online, with the option to pick up groceries at the store or have them delivered.','2015-02-09 19:47:20',153,'162.209.1.123',1),(58,14,'I have a son who has febrile seizures.  You can bet we would buy a digital monitoring device to keep track of his temperature during bouts of sickness.','2015-02-09 19:49:23',825,'162.209.1.123',1),(59,30,'I think something along these lines is already being worked on by the Food AVe team, but I like the station ideas. ','2015-02-09 20:00:33',817,'162.209.1.123',1),(60,10,'Great idea! I would use this and love how it supports our existing Owned Brands.','2015-02-09 20:17:19',838,'162.209.1.123',1),(61,12,'I love how this concept enables more time for fun (social media) while simultaneously reducing the drollery of grocery shopping.  Guests spend more time doing what they like and being with their families, not navigating aisles with screaming kids.','2015-02-09 20:28:20',362,'162.209.1.123',1),(62,13,'I think the concept is great as it addresses wellness as a whole, but given the vehicle, do we can more value by opening it up to all recipes and just making a big wellness statement?  Can it be integrated with something like Allrecipes or UrbanSpoon? ','2015-02-09 20:34:48',722,'162.209.1.123',1),(63,43,'Great question! We did discuss sorting items on the wellness spectrum purchased from other retailers (user scanning item/receipt). Limiting factors for us were increased effort level, potential for poor experience (ie item not recognized), and minimizing incentive to shop at TGT. Open to feedback!','2015-02-09 20:48:02',181,'162.209.1.123',1),(64,12,'This is a great concept.  I love bringing together Pintrest and Target together.  It would be awesome if this would also work with other recipe collection sites like Yummly.  It would also be great if you had the option to not only pick up in store, but also have home delivery.  ','2015-02-09 21:33:17',874,'162.209.1.123',1),(65,44,'Have you considered a tie-in to online (.com or mobile) shopping? How about a connection to Subscriptions to have vitamins delivered on a regular basis?','2015-02-09 21:44:11',80,'162.209.1.123',1),(66,36,'How might you make this a viable option at a PFresh store?  In addition, you may want to talk to some of the folks in Perishables that manage the Thanksgiving Day dinners that we offer at Super Targets.','2015-02-09 21:58:31',727,'162.209.1.123',1),(67,41,'Good idea - you mention that Millennials look to grocery for this type of service, how might you make the service compelling enough to come to Target for it?  In addition, the Food Avenue team has done some work in the past on a healthier menu - you may want to check with them on what they learned','2015-02-09 22:02:57',727,'162.209.1.123',1),(68,44,'Hi Liz, yes definitely. I think we can build a wellness ecosystem around this technology. Vitamin subscriptions would be big. ','2015-02-09 22:06:53',59,'162.209.1.123',1),(69,42,'love this.  the personalization is great!','2015-02-09 22:08:29',386,'162.209.1.123',1),(70,42,'Clarifying question: are the incentives (e.g. 25% off yoga gear) personalized based on my app selections? Or advertising existing deals/sales/coupons? I like the personalized wellness goals and thinking about what would drive me back to the app. How often do I get new content? Are deals just for me?','2015-02-09 22:10:04',80,'162.209.1.123',1),(71,12,'love the feature that connects my pinterest to my tgt shopping cart!','2015-02-09 22:12:16',869,'162.209.1.123',1),(72,42,'Love it.  Would love to be able to set and forget my preferences (editable if desired) and know that Target will use those preferences to personalize offers and content (e.g. coupons, email content, new item launches, etc.).','2015-02-09 22:54:45',825,'162.209.1.123',1),(73,31,'I would like to see this as an option for redcard guests who want the 1% to go to the 529 as opposed to a community school.  The option may be a way to keep our support for education, while supporting guests.','2015-02-09 23:09:30',874,'162.209.1.123',1),(74,25,'I like the idea of being able to earn points by doing fitness or other wellness activities.  I would love to see this a bit broader where you could earn points to apply to discounts on C9 apparel and workout equipment. ','2015-02-09 23:18:47',874,'162.209.1.123',1),(75,25,'Hilarious video! Great work.','2015-02-10 03:01:07',72,'162.209.1.123',1),(76,44,'I like your idea to make it simpler for the guest to choose the right vitamin.  Perhaps the technology could also suggest organic foods that are high in the vitamin for the guest that prefers not to take supplements.','2015-02-10 12:59:58',101,'162.209.1.123',1),(77,43,'I like the idea of the dashboard for the guest to review their efforts and progress.  I worry about the amount of time the guest has to invest.  I think we would need to make the Target rewards for the guest a little more sweet to keep their attention.','2015-02-10 13:06:22',101,'162.209.1.123',1),(78,41,'I like the idea but I wonder if this idea is more of a stand-alone franchise restaurant/dinner assist service that Target should start and sell off.','2015-02-10 13:15:36',101,'162.209.1.123',1),(79,39,'Great idea.  I might suggest instead of showing the entire content at once you break it into 2 segments - one pre-dinner while dad is prepping and the kids are getting excited and a 2nd segment for after-dinner.  The 2nd segment ensures the kids eat the meal and get rewarded with the extra video.','2015-02-10 13:29:42',101,'162.209.1.123',1),(80,38,'Great ideas.  I truly think to make these healthy meal apps a success that Target should acquire a top-rated grocery delivery company like you have suggested.  We are not experts on food delivery and most of these ideas really require that expertise in order to be successful.','2015-02-10 13:34:16',101,'162.209.1.123',1),(81,36,'Great name and meets a guest want.  The ability for pre-measured ingredients still troubles me from a logistics idea.  I think ultimately the guest is only going to be happy with delivered ingredients to their home for the meal.  Target should purchase a logistics delivery company.','2015-02-10 13:55:39',101,'162.209.1.123',1),(82,34,'I think two of your ideas really resonated with me.  The Target Lifestyle Events and linking them to a Target Lifestyle Social Network.  The guest wants to be involved and it has been shown that when your friends are active and healthy it helps motivate you to do the same.','2015-02-10 13:59:15',101,'162.209.1.123',1),(83,32,'Cool idea to build on Cartwheel!','2015-02-10 14:02:56',101,'162.209.1.123',1),(84,36,'Great concept. This could appeal from Boomers through Generation Z. Logistics would be interesting: Keeping up with demand. Ensuring food is kept at the proper temperature. What would be the potential liability? Perhaps the â€œTarget to Tableâ€ bag/container could be reusable and insulated â€“ think sust','2015-02-10 14:03:43',930,'162.209.1.123',1),(85,12,'If I find something I would like to make I rarely make it because 1)I never have the right ingredients at home 2) I will go to the store and forget to get something.  This would be perfect for me!  ','2015-02-10 14:49:32',554,'162.209.1.123',1),(86,12,'If I find something I would like to make I rarely make it because 1)I never have the right ingredients at home 2) I will go to the store and forget to get something.  This would be perfect for me!  ','2015-02-10 14:50:57',554,'162.209.1.123',1),(87,44,'John - yes I think that is a good call. ','2015-02-10 14:53:46',59,'162.209.1.123',1),(88,16,'Love how this service would make Target feel like a smaller, community-driven resource for guests!','2015-02-10 15:16:55',972,'162.209.1.123',1),(89,12,'I think this is great...as a way to kickstart it Target could partner with Pinterest to find one or two popular meals and offer a meal kit with all the ingredients.  ','2015-02-10 15:23:11',978,'162.209.1.123',1),(90,13,'great concept and solution for integrating target into easy and healthy meal planning.  as a busy single parent, this concept would appeal to me.','2015-02-10 15:30:22',986,'162.209.1.123',1),(91,36,'I like this concept. Healthy options easy in and out! Maybe an option is to have one showcase meal in a cooler up at the front of the store. If you have not placed an order or you are just bowsing you can still walk in grab all the items you need from the front cooler/case check out and be on your w','2015-02-10 15:36:36',979,'162.209.1.123',1),(92,10,'This would be a great addition to Cartwheel and I really like the option to scan items at home to create a list of favorites for when I arrive at the store. Tie in Cartwheel offers and further the guest experience and value prop.','2015-02-10 15:39:11',84,'162.209.1.123',1),(93,36,'I really like the idea.  Include the recipes to make the meal too.  The guest might need to select the items needed for purchase - size of milk, size of cheese. ','2015-02-10 18:41:08',1049,'162.209.1.123',1),(94,13,'1) chef feels overwhelming.\r\n2) doing pre-work out of store - do people have time for that? \r\n3) how could it be simpler....aka, can she input things she knows her family loves...chicken, green beans, red potatoes....and could it spit out a home run recipe? then she can add to list?','2015-02-10 18:46:27',1047,'162.209.1.123',1),(95,36,'simple! and it may teach someone like me to cook better... :)  \r\nwhere do i sign up? i have done plated and it is spendy.','2015-02-10 18:49:02',1047,'162.209.1.123',1),(96,36,'love this idea.  it would be nice to know the extra ingredients and if they could order on the same app that would be really neat.  Could offer larger serving sizes for larger families or at least have that option.','2015-02-10 18:49:41',1052,'162.209.1.123',1),(97,30,'love the tasting of a whole recipe to see if you like it. also like the grab and go idea. or what about eat there? \r\nnot sure about the wellness indicator - is it too much/in your face? most people want small improvements that are easy! ','2015-02-10 18:52:12',1047,'162.209.1.123',1),(98,44,'i personally would not think this is \"credible\" as a guest. ','2015-02-10 18:54:49',1047,'162.209.1.123',1),(99,12,'Sukie- Initially, we would offer a few recipes (substitutes for market pantry items - Pfresh stores). As this concept continues to grow and develop, we would see a demand increase for specialty products and could source as necessary. We want to provide our Guests with as many options as possible!','2015-02-10 19:12:44',154,'162.209.1.123',1),(100,37,'The things that are appealing are the all encompassing approach to wellness-fitness, food, &environment; with a direct tie to the biz. The even better if: if the audience is folks new to fitness perhaps a way to ease them into fitness vs so many diff options? How do I even begin? Trainer pointers?','2015-02-10 19:31:52',462,'162.209.1.123',1),(101,37,'The things that are appealing are the all encompassing approach to wellness-fitness, food, &environment; with a direct tie to the biz. The even better if: if the audience is folks new to fitness perhaps a way to ease them into fitness vs so many diff options? How do I even begin? Trainer pointers?','2015-02-10 19:31:57',462,'162.209.1.123',1),(102,12,'I would definitely use this!','2015-02-10 20:16:01',1087,'162.209.1.123',1),(103,44,'This might be interesting to tie in to the new Healthful app and possibly include any interactions/deficiencies with any medications they are currently taking.','2015-02-10 20:20:04',76,'162.209.1.123',1),(104,43,'I love the link to \"personalization\" on target.com and on cartwheel...I think that is the biggest idea here. So if I self-identify as organic, everything I should see on target.com and in my own cartwheel collection should be that. The \"accountability\" part gets a little big brother to me.','2015-02-10 21:13:30',1047,'162.209.1.123',1),(105,42,'i like this - it is simple, i can opt into what my interests are, and it does not come off as judgmental. i can see it being fun vs. \"serious\", but allows small improvements that make you feel good.','2015-02-10 21:15:34',1047,'162.209.1.123',1),(106,41,'Sounds like Plated. is this our core competency? Where is the Target twist/integration? Feels like cooking light could do this on their own.','2015-02-10 21:18:55',1047,'162.209.1.123',1),(107,12,'i like it...typically i see things all the time on pinterest. my problem is not list-making - it is being successful at it! so rating recipes like EASY or UNDER 20 MINUTES would be really helpful. and that normal people rate how great it is would be important to the credibility.','2015-02-10 21:37:39',1047,'162.209.1.123',1),(108,43,'Great feedback! After signing up, no additional effort is needed in order to receive analysis or rewards. Our thought was to have â€œbaseâ€ wellness parameters pre-set to identify items, with the option of customization for interested Guests. ','2015-02-10 23:02:44',51,'162.209.1.123',1),(109,31,'I like the idea of keeping college saving as a no-brainer for parents but might suggest this idea is better if not linked to Redcard (separate program).  The Target guest is already worried about having personal information tied to un-protected store charge cards.','2015-02-11 13:17:42',101,'162.209.1.123',1),(110,30,'Great idea to re-purpose some of the underutilized/unproductive portions of the store to drive traffic.','2015-02-11 13:20:36',101,'162.209.1.123',1),(111,27,'Great idea to create meals based on athletes needs using Target provided foods to make it easier on parents.  I think the program could easily expand to other guest needs as well.','2015-02-11 13:28:19',101,'162.209.1.123',1),(112,26,'Great idea.  Routine shopping will no longer be the reason people go to a Target store in 5-years and we need ways to re-purpose and add value to the store location.','2015-02-11 13:31:48',101,'162.209.1.123',1),(113,25,'Great concept of linking exercise activities to earning coupons for healthy Target grocery items.  The concept could expand as well to earning rewards for healthy shopping purchases as well.','2015-02-11 13:37:07',101,'162.209.1.123',1),(114,23,'Awesomely simple idea that is easy for the guest to participate and ties in options for how the guest can \"spend\" her rewards including donating.  Nice job!','2015-02-11 13:41:28',101,'162.209.1.123',1),(115,22,'I like the idea of understanding at the point you choose the product whether or not a more healthy option exists but suggest that the cart itself should have the working scanner and display screen so that the guests hands remain free to pickup items.','2015-02-11 13:47:11',101,'162.209.1.123',1),(116,20,'I like the idea of helping the guest in purchasing ingredients for quick healthy meals.  Perhaps the app could choose two or three recipes that use similar and additional ingredients to help the guest plan more than 1 meal.','2015-02-11 13:53:06',101,'162.209.1.123',1),(117,36,'Super cool!  I want it to start now!','2015-02-11 14:19:07',922,'162.209.1.123',1),(118,7,'There are a number of app ideas out there, but I really like how you included price, menu items, Cartwheel and other options into one platform. As the primary shopper in the house, I would certainly leverage this app.','2015-02-11 15:05:17',84,'162.209.1.123',1),(119,42,'Hey Liz, the concept would be is that deals, rewards for simple fun challenges, and product discovery would be isolated to wellness initiatives only, and would only display based on your preferences you selected.\r\n','2015-02-11 15:21:30',337,'162.209.1.123',1),(120,15,'I LIKE: This idea feels fresh and different (in a good way).\r\nI WISH: I understood how hard this is to do technically.\r\nHOW MIGHT YOU BRING IT TO LIFE: One way to get kids to love it is by tying to the popular show \"Wild Kratts.\" Its heroes use just such chips to gain the powers of different animals','2015-02-11 16:14:20',364,'162.209.1.123',1),(121,36,'Super cool idea! I would use it all the time! ','2015-02-11 16:39:25',1172,'162.209.1.123',1),(122,36,'Great Idea. While health meals are the most important, could the guest add on to the order to be delivered or picked up? ex. I would also like a 1/2 gallon of skim milk because we are out and a need a load of bread to make lunches tomorrow. Also, while healthy is important,what about dessert?','2015-02-11 16:42:07',1174,'162.209.1.123',1),(123,36,'Creative concept! I like the name!','2015-02-11 16:45:44',1175,'162.209.1.123',1),(124,31,'Great idea.  Works in an area already speaking to passionate guest (TCOE).  Uses existing concept (Keep the change) and can be layered into future initiatives like Red Perks.  Can be used to drive more loyalty in BTS time period by increasing matching.  Offer discount during BTC for plan members.','2015-02-11 16:51:15',722,'162.209.1.123',1),(125,40,'Love this idea. ','2015-02-11 17:02:57',60,'162.209.1.123',1),(126,26,'I like it! Kind of like hi-tech for well-being in the store. ','2015-02-11 17:14:34',926,'162.209.1.123',1),(127,30,'I love the Lemonade model in California. Incredibly healthy \"fast\" food. Caters to lots of food needs. http://www.lemonadela.com/\r\n','2015-02-11 17:17:33',928,'162.209.1.123',1),(128,45,'Love the concept but would like to know more about the user experience. Is it a stand alone app or part of the website? ','2015-02-11 17:39:32',684,'162.209.1.123',1),(129,40,'simialr to the target table concept. Merge some of the food concepts?','2015-02-11 18:06:10',928,'162.209.1.123',1),(130,17,'I like the idea of an in-store kiosk to help guide the guest.  Aging guest or those with special needs may not embrace a phone app.','2015-02-11 18:17:36',101,'162.209.1.123',1),(131,32,'elegant idea, extending a platform we already have an are learning from','2015-02-11 18:21:10',75,'162.209.1.123',1),(132,26,'there is the seed of something intriguing here -- a way to tap and extend what \"community\" means in a physical setting @ existing stores. ','2015-02-11 18:24:34',75,'162.209.1.123',1),(133,15,'Really appreciate the thoughtful approach to impacting the youngest Target guests in healthy behaviors through the rewards program.  Would there be other ways parents could add reward points to their children remotely based on other healthy choices made by the children - like eating a healthy snack?','2015-02-11 18:30:57',101,'162.209.1.123',1),(134,36,'Love the idea and the name. Would want to ensure that the ingredients are fresh (no preservatives, pre-packaged, etc). That is what I dislike about the new grab and go meals in perishables- there is so much stuff added to increase the shelf life - I just want whole/real easy food. ','2015-02-11 18:32:21',116,'162.209.1.123',1),(135,14,'I have a niece with diabetes, her mom would love piece of mind from techno links.  Could the appeal of this be expanded to assist more parents?','2015-02-11 18:36:56',101,'162.209.1.123',1),(136,46,'Love that it is simple to execute on, do think this is a great to create personal interaction with a guest and showcase expertise. My questions are how could Target earn guest credibility to deliver on this, given low awareness of our clinics and pharmacy? But this could be a great start.','2015-02-11 18:44:09',1196,'162.209.1.123',1),(137,46,'Nice personal touch.  Would you allow the parent to customize/refine the get better kid prior to purchase?','2015-02-11 18:51:34',101,'162.209.1.123',1),(138,45,'The combination of all these things helps improve the desire of the guest to use the Target app but we would need to be careful in launch because if there is an issue with any portion of the app, you lose the entire guest.','2015-02-11 18:55:10',101,'162.209.1.123',1),(139,46,'I think this is a great way to drive awareness of our Pharmacy option, and help convert guests to this service.  I think this idea would be even better if home delivery was an option.  Or allow parents to pay a little extra for that service.','2015-02-11 18:59:58',147,'162.209.1.123',1),(140,8,'I am curious how you can refine this approach to be uniquely Target?  Restaurants are beginning to explore similar concepts and already have an advantage on Target in that they are already experts in providing dining experiences to patrons.','2015-02-11 19:01:33',101,'162.209.1.123',1),(141,12,'Awesome idea.  I love how it pulls together the different tasks needed to prepare food for your family.','2015-02-11 19:06:40',1201,'162.209.1.123',1),(142,47,'Great concept and a no-brainer.  Potentially not huge impact, but we should just do it asap anyway.\r\nAlso, could extend this platform to bakery (cakes), vision (glasses), and other services...','2015-02-11 19:09:42',1202,'162.209.1.123',1),(143,47,'Great idea! I always feel impatient asking if it is taking longer than I expected. ','2015-02-11 19:13:06',186,'162.209.1.123',1),(144,44,'Interesting concept as long as\r\n- non evasive\r\n- no data kept/ private\r\n- we can partner','2015-02-11 19:13:27',1202,'162.209.1.123',1),(145,44,'I like this idea.  I think it could work.  If we had disclaimer info similar to  pressure cuffs in gyms and stores. I love the idea of providing both suggestions for organic foods that are high in the vitamin, and bottled vitamins.','2015-02-11 19:15:26',346,'162.209.1.123',1),(146,47,'I think this idea is a groundbreaking change for the pharmaceutical industry.  Target would lead the pack in a new tech that could wow consumers.  I would love the tracker to help me know when to walk back toward the heath isle when waiting for medication.  Awesome idea!','2015-02-11 19:20:04',113,'162.209.1.123',1),(147,47,'Wonderful idea and probably fairly easy to implement. If Dominos can do it surely we can too. It makes sense to put money into an app so our Pharmacists can focus on what they do best--fill the orders and answering important questions about the medication.','2015-02-11 20:01:11',1214,'162.209.1.123',1),(148,30,'correct that there are already plans to reinvent Food Ave/Target Cafe with upgraded food options/restaurant partnerships, but LOVE this idea!','2015-02-11 21:14:04',230,'162.209.1.123',1),(149,22,'If the goal is for the prices to actually be the same so the guest can always choose the healthy option, are there certain categories that we only offer organic? Would an organic buy like that help us offset the cost so we can have only organic lemons at the lower price?','2015-02-11 21:17:31',86,'162.209.1.123',1),(150,44,'Yeah it really comes down to the technology. If what Vitastiq.com is using is highly accurate then the potential for Target is big. First steps would be to get a proto from them and test. Then look at what technology other companies have developed in this space.','2015-02-11 21:26:11',59,'162.209.1.123',1),(151,36,'I would absolutely promote this to friends and families that mirror the hectic lifestyle that could use this benefit coming from Target.  Love the simplicity and another huge convenience for Target on the go shoppers!  Love it!','2015-02-11 21:33:29',400,'162.209.1.123',1),(152,42,'Love this one!','2015-02-11 21:37:14',1219,'162.209.1.123',1),(153,47,'Could we integrate this into the Target Healthful app?','2015-02-11 21:37:32',249,'162.209.1.123',1),(154,12,'Have you considered other fulfillment options? Like at-home delivery? Or curb-side pick-up? Would be great to not always have to go to the store. (And, by the way, do we sell figs?)','2015-02-11 22:28:33',80,'162.209.1.123',1),(155,46,'I agree with the home delivery option!','2015-02-11 22:33:24',80,'162.209.1.123',1),(156,41,'This might make for an interesting acquisition of an existing company/service rather than a build-from-scratch...','2015-02-11 22:42:17',80,'162.209.1.123',1),(157,13,'Since \"healthy\" can mean different things to different people, would you consider allowing users to establish settings (low-fat, whole foods, etc.). Also, would be helpful if the user is allowed to save recipes as favorites to return to some tried and true choices in the future.','2015-02-11 22:58:49',723,'162.209.1.123',1),(158,7,'Nice video to highlight key concepts that need to be included if Target pursues the creation of a meal app.','2015-02-12 13:47:50',101,'162.209.1.123',1),(159,6,'Anyway that Target can expand the concept so that guest visits Target just for grocery items?','2015-02-12 13:53:52',101,'162.209.1.123',1),(160,6,'(Please ignore other comment.  It did not capture my thoughts.)  Anyway that Target can expand the concept so that guest visits Target for more than just grocery items?','2015-02-12 13:55:10',101,'162.209.1.123',1),(161,4,'Improvement apps surrounding healthy meals is a great idea.  Would there be other enhancements to this or do you feel this concept would generate sufficient new sales for Target?','2015-02-12 14:11:06',101,'162.209.1.123',1),(162,34,'Great Idea!  I agree with the comments below about differientiating the quiz.  Instead of saying you are at this % of wellness, it would be even better if it said take these small steps/actions to increase wellness by x%.  And sending friendly reminders.  Also like the social aspect.','2015-02-12 15:28:46',1227,'162.209.1.123',1),(163,30,'Love the idea of healthy fast food.  The options are great for a guest to try and then incorporate into their daily lives.  I also like the wellness indicator (similar to the one in the cafe).  If I am debating between two dishes, the wellness indicator helps me decide the better of the options.','2015-02-12 15:34:01',1227,'162.209.1.123',1),(164,45,'Love this idea - this is definitely something that would set Target apart.  The planning process is the hardest part when putting together healthy meals (or any meal for that matter).  Great that it would be a part of the Target app, and not standalone.  ','2015-02-12 15:37:36',90,'162.209.1.123',1),(165,36,'I really love this idea! I believe both Target and Guests can benefit from this. I think it is convenient for our guests as long as we keep up with the consumerâ€™s changing demands; I would be grateful to have it available and I think families would appreciate it. \r\nSuper Cool and canâ€™t wait.','2015-02-12 17:20:49',1251,'162.209.1.123',1),(166,48,'Overall I think this could be interesting to test in a smaller market. Could we also include a Tailor/seamstress component in here as well (get your pants hemmed in 1 hour). It would have the potential to drive A&A sales.My Only question is \"Do we have the right Guest for this?\"','2015-02-12 17:26:15',1253,'162.209.1.123',1),(167,48,'Overall I think this could be interesting to test in a smaller market. Could we also include a Tailor/seamstress component in here as well (get your pants hemmed in 1 hour). It would have the potential to drive A&A sales.My Only question is \"Do we have the right Guest for this?\"','2015-02-12 17:26:37',1253,'162.209.1.123',1),(168,48,'Overall I think this could be interesting to test in a smaller market. Could we also include a Tailor/seamstress component in here as well (get your pants hemmed in 1 hour). It would have the potential to drive A&A sales.My Only question is \"Do we have the right Guest for this?\"','2015-02-12 17:26:44',1253,'162.209.1.123',1),(169,36,'I like that I can do a \"drive thru\" (have the ingredients) delivered to my car ... and still eat fresh!','2015-02-12 17:35:42',869,'162.209.1.123',1),(170,44,'I think that this is an interesting idea. However, I question if our guest would \"trust\" enough to really leverage this. I feel that there could be a guest perception that we are just trying to increase their spend. Also, I agree that there could be data concerns here.  ','2015-02-12 17:37:33',1253,'162.209.1.123',1),(171,13,'I like the idea, but would like it expanded to more than just \"healthy\" meals. Maybe the guest can get reward with cartwheel coupons for \"healthy\" products, but the options for any meals in 30 mins or less with the link to a grocery list is attractive.  ','2015-02-12 17:40:57',869,'162.209.1.123',1),(172,47,'looks like a really easy solve for our guests who lead busy lives. Would there be a way to add incentives for our guests to shop while they wait? ','2015-02-12 17:42:50',869,'162.209.1.123',1),(173,12,'like the idea of being able to bring pintrest daydreams into a reality (in our stores!)','2015-02-12 17:44:33',869,'162.209.1.123',1),(174,31,'I like this idea a lot. However, how to we create the same value proposition for the guest that does not have children? ','2015-02-12 17:45:33',1253,'162.209.1.123',1),(175,30,'The \"Grab and Go\" seems similar to what we have in SuperTargets already','2015-02-12 17:45:50',869,'162.209.1.123',1),(176,31,'Where does the 1% come from? Do we really think that the guest will be able to save that much money this way?','2015-02-12 17:57:31',869,'162.209.1.123',1),(177,23,'love it! easy, seamless and a win win for all!','2015-02-12 18:00:46',869,'162.209.1.123',1),(178,47,'I love this idea!  This could be more than just a guest win, but also a payroll win by reducing the number of guest interactions per transation (both in-person and via phone) for the pharm teams!','2015-02-12 18:53:13',95,'162.209.1.123',1),(179,39,'I agree with the other comment about how to engage with a post-diner event (and how to also include other parents in the household). I like the tie-in with popular characters, and the food item renaming.','2015-02-12 19:46:02',80,'162.209.1.123',1),(180,20,'Love the integration of price, coupons, and location of the item in the store!','2015-02-12 20:00:47',1282,'162.209.1.123',1),(181,31,'What is the benefit to Target? Does giving money to individuals have the same reputation impact as does giving to schools/communities? \r\n\r\nI also have the same question as another about the proposition to individuals/families without children.','2015-02-12 20:08:27',80,'162.209.1.123',1),(182,48,'Would this concept fit well with CityTarget/TargetExpress? Smaller footprint stores might facilitate more efficient drop-off/pick-up and might be in a good spot for the Guest (near work).','2015-02-12 20:12:40',612,'162.209.1.123',1),(183,26,'How could you expand an environment like this in the digital space - and go after the visibility we have on .com and mobile?','2015-02-12 20:15:17',80,'162.209.1.123',1),(184,20,'Love this idea. I would totally look at this to get ideas on what i should buy and make from Target!','2015-02-12 21:01:10',1294,'162.209.1.123',1),(185,12,'Really great idea and I agree with the comment of potentially having multiple fulfillment options, like home delivery or curb-side pick-up.I would use this app!','2015-02-12 21:14:37',801,'162.209.1.123',1),(186,45,'Love the capabilities that this would offer (meal cal, list, importing from Pinterest)','2015-02-12 21:34:10',869,'162.209.1.123',1),(187,20,'This is awesome!! Great app for people just starting to cook  : )','2015-02-12 21:35:48',1301,'162.209.1.123',1),(188,48,'I like the out of the box thinking of how to repurpose the stores to meet additional guest needs.','2015-02-12 21:44:39',101,'162.209.1.123',1),(189,42,'Really dig these ideas. Personalization is the future and technology will play a critical role in getting there. Simple updates like this will be a fantastic draw for Target guests!','2015-02-12 21:50:06',1302,'162.209.1.123',1),(190,17,'Would also be great to have same-day, at-home delivery.','2015-02-12 22:08:21',80,'162.209.1.123',1),(191,16,'This could be a great acquisition opportunity to purchase a company/service who does this well today (I know of at least one existing service) - gain an already tested service with an existing customer base (potentially a new customer group for us, too).','2015-02-12 22:12:04',80,'162.209.1.123',1),(192,36,'Love this idea actually. Sounds fantastic. I would love to do this even at the beginning of the week - and pick up 2 or 3 nights of dinners at once. ','2015-02-13 00:06:59',117,'162.209.1.123',1),(193,30,'I like the wellness indicators - like we have in Target cafe. It does influence the choices I make.','2015-02-13 00:20:13',117,'162.209.1.123',1),(194,48,'Thinking of how current dry-cleaners send the clothes to outside facilites, how might we offer this within 1 hour?','2015-02-13 02:27:21',22,'162.209.1.123',1),(195,20,'Wow! Save money and eat healthy. ','2015-02-13 09:26:34',1332,'162.209.1.123',1),(196,20,'Love the idea!!','2015-02-13 09:33:29',1334,'162.209.1.123',1),(197,21,'This reminds me of cooking classes/demos at Whole Foods (as one example).  I think some guests would like this initially - but I wonder if participation would diminish as the novelty wears off?  I also wonder about the cost/benefit ratio of the idea.  ','2015-02-13 14:02:30',147,'162.209.1.123',1),(198,4,'Love that this idea uses an already well-established tool to reach guests.  (Minimizes conversion challenges.)  To ensure guests would actually MAKE the recipe once they got home, I would want to ensure they were simple and quick.','2015-02-13 14:07:12',147,'162.209.1.123',1),(199,6,'Love the idea of allowing guests to order in store at the beginning of their shopping trip, and pick-up their box at the deli just before they leave/check out.  This does feel very \"Mix & Match\", though; I wonder if the guest will see the difference?  And will that difference be enough?','2015-02-13 14:10:51',147,'162.209.1.123',1),(200,6,'I also think any idea that shifts significant workload to our store TMs is going to be difficult to execute and a challenge to get profitability from.','2015-02-13 14:12:18',147,'162.209.1.123',1),(201,20,'Love this!! Wish I had this app now!','2015-02-13 14:28:33',1340,'162.209.1.123',1),(202,25,'Love the idea of integrating healthy eating and exercise into one!  Could this be an extension within Cartwheel platform?  Since we have millions of users already there, we could introduce a Wellness Collection that would unlock when fitness activities are tracked?  ','2015-02-13 14:33:26',792,'162.209.1.123',1),(203,14,'LOVE the concept - but this feels like a HUGE legal risk to Target.  For example, what if an expecting mom uses the fetal heartbeat app and it shows everything is fine, but than an issue develops? ','2015-02-13 14:39:17',147,'162.209.1.123',1),(204,16,'I agree with Liz - I think this would be an awesome acquisition opportunity.','2015-02-13 14:52:48',147,'162.209.1.123',1),(205,48,'Love the OOB thinking; but some dry cleaners do offer \"green\" services already. I also wonder about the infrastructure required for this venture; feels very costly to me.','2015-02-13 14:55:23',147,'162.209.1.123',1),(206,17,'Love the idea of allowing guests to order in store at the beginning of their shopping trip, and pick-up their order just before they leave/check out. This does feel very \"Mix & Match\", though; I wonder if the guest will see the difference? And will that difference be enough?','2015-02-13 14:59:25',147,'162.209.1.123',1),(207,18,'Love the integration of financial tracking and food journaling - could be a powerful combination!  What would be the incentive to drive additional dollars into Target, though?','2015-02-13 15:02:20',147,'162.209.1.123',1),(208,20,'Feels a lot like Recipes.com - but I love the price integration piece (i.e., finding items on TPC, ad, cartwheel, etc.).','2015-02-13 15:07:14',147,'162.209.1.123',1),(209,22,'Love the title - and the idea!  I wonder if Target would lose $ on this venture, though?  For example, how long would it take a guest to convert from  buying organic lemons (low price point, low margin) to buying organic sheets (high price point, high margin)?','2015-02-13 15:10:40',147,'162.209.1.123',1),(210,23,'Matt Becker captured my same thoughts.  :)  I also wonder how this would drive incremental sales for Target?','2015-02-13 15:13:50',147,'162.209.1.123',1),(211,26,'I love that this idea is truly flexible/customizable to what each individual guest wants!  Feels like a great compliment to A Bullseye View, for example.','2015-02-13 15:24:50',147,'162.209.1.123',1),(212,30,'I love the repositioning of our current pizza/cafe offerings.  This could be a true differentiator!','2015-02-13 15:30:42',147,'162.209.1.123',1),(213,31,'I like the spin on the traditional TCOE model.','2015-02-13 15:32:36',147,'162.209.1.123',1),(214,32,'Great addition/enhancement to Cartwheel!  Another extension could be posting healthy choices made to Facebook (to increase scope and visibility).','2015-02-13 15:35:27',147,'162.209.1.123',1),(215,34,'I really like the customized approach that the quiz concept provides - and I like the integration into a Lifestyle network where guests can find like-minded individuals.','2015-02-13 15:38:33',147,'162.209.1.123',1),(216,36,'I like the concept - but I wonder if this will resolve the real time crunch?  (I.e., guest still has to MAKE dinner when they get home.)  I also think any solution that puts more strain on our store TMs is going to be challenging.','2015-02-13 15:42:58',147,'162.209.1.123',1),(217,12,'Yes, we do feel that the guest could receive the products in any way they wish in the future, truly playing to omnichannel fulfillment in giving the guest the freedom to get what they want how they want it. ','2015-02-13 15:47:48',114,'162.209.1.123',1),(218,18,' those milestones reward with incentives through cartwheel, future loyalty programs, exclusives, pertinent content to their behavior!\r\n','2015-02-13 16:14:31',200,'162.209.1.123',1),(219,23,'Thanks for the feedback! I would definitely work out the earnings/step to make sure it was enough incentive while still making sense for Target. Ideally, this would get people to walk more in the store to boost sales, paying for the earned rewards.','2015-02-13 16:18:18',118,'162.209.1.123',1),(220,41,'Great idea!  It seems like putting boxes together for guests including the items they need to make would be viable for Target.  The hot prepared meals seem like they would be a bit more challenging to implement - esp if we are focusing on individual diet restrictions.','2015-02-13 16:27:44',95,'162.209.1.123',1),(221,30,'Love connecting healthy options to purchase options. Something other than breadsticks, pizza, pretzels, cookies, bars, chips, soda, icees, etc... I went grocery shopping hungry (mistake) and decided to go to the cafe. I chose to eat nothing versus eat anything that was available. Good opportunity.','2015-02-13 16:31:14',121,'162.209.1.123',1),(222,36,'stef makes a great point - the extra strain on TMs will be tough, especially if the orders are being picked up during peak traffic times. it could mean less attention spent with consumers in store. ','2015-02-13 16:37:56',342,'162.209.1.123',1),(223,48,'I like how convenient it would be to have a green dry cleaning option at Tgt, I worry about having space in the store to facilitate storing the dry cleaning and also worry about Tgt dealing with customer satisfaction issues related to drycleaning and resulting in negative guest impressions of Target','2015-02-13 16:40:02',1366,'162.209.1.123',1),(224,22,'I think it would be interesting to go beyond just organic. Not all organic products are better. ','2015-02-13 17:07:27',117,'162.209.1.123',1),(225,13,'Good idea, could we default to Target items yet expand to other choices as well. Brand preference is a bigger sell than saving money for some. ','2015-02-13 17:21:24',361,'162.209.1.123',1),(226,48,'Cool idea, feels like it might be easy to test and learn.  Definitely convenient, drives trips, etc.  ','2015-02-13 17:28:36',1392,'162.209.1.123',1),(227,27,'I like the idea, but maybe would be better part of a global app about nutrition and exercise.','2015-02-13 18:43:17',1214,'162.209.1.123',1),(228,20,'Fun idea!','2015-02-13 19:27:32',1415,'162.209.1.123',1),(229,47,'I like the idea, could it be incorporated to any instance of waiting in the store? (i.e. photo, optical, etc...)','2015-02-13 20:25:21',1371,'162.209.1.123',1),(230,48,'I am super into this! Seems like it would be best at stores near business districts/urban centers? Can we also open one at HQ :)','2015-02-13 20:42:35',1047,'162.209.1.123',1),(231,46,'nice! can they also recommend if the child should see a doctor vs. take something over the counter (aka, an ear infection needs to be seen to be solved)?','2015-02-13 20:56:50',1047,'162.209.1.123',1),(232,10,'Great idea! I think it could also be incorporated to coupons, recipes and cartwheel. On a side note the video was great!','2015-02-13 21:02:51',1214,'162.209.1.123',1),(233,32,'I like the group connection-- it inspires some competitive spirit!','2015-02-13 21:24:37',754,'162.209.1.123',1),(234,13,'I like how you have followed the guest journey and tried to solve for the end-to-end experience.  Beyond product sales, what other revenue models exist to bolster the business case?  Could this extend beyond just the Target trip or shop?','2015-02-13 21:45:21',1448,'162.209.1.123',1),(235,48,'Drycleaning is definitely a trip driver but it is a pretty crowded space.  How have you thought about one of the critical parts of these \"errand trips\" - the ease of getting in and out quickly?  What can we uniquely bring to the space due to our capabilities?','2015-02-13 21:48:46',1448,'162.209.1.123',1),(236,5,'Being someone who has health issues I like the idea of being able to scan a product and have it tell me yes or no and alternatives. Maybe tied in with one of the chef apps. I wonder if there is app out there already doing this that we could acquire.','2015-02-13 21:48:49',1214,'162.209.1.123',1),(237,30,'Target has an opportunity to be a real leader in this area. Would love to see this happen in a very real and meaningful way. ','2015-02-13 21:52:16',1457,'162.209.1.123',1),(238,30,'LOVE GRAB AND GO!!!!','2015-02-13 21:56:56',1460,'162.209.1.123',1),(239,44,'Maybe the testing could be done inside Target Clinics to increase our credibility - physician could include vitamin recommendations as part of printed treatment summary.','2015-02-13 21:56:58',1409,'162.209.1.123',1),(240,30,'LOVE GRAB AND GO!!!!','2015-02-13 21:57:23',1460,'162.209.1.123',1),(241,12,'I like that you have followed the guest on their meal planning journey.  I also like the social inspiration.  How are you thinking about matching recipes to actual grocery skus?  Also, how might you extend this beyond just a Target shopping trip?','2015-02-13 21:57:51',1448,'162.209.1.123',1),(242,41,'Like it!  Love the idea of potentially using locally sourced ingredients!','2015-02-13 21:59:46',1462,'162.209.1.123',1),(243,41,'What distinctive assets does Target bring to this space?  And what did you learn about Seattle Sutton, Blue Apron or any of the various current competitors in this space?','2015-02-13 22:03:18',1448,'162.209.1.123',1),(244,12,'This sounds like a great idea!  ','2015-02-13 22:10:27',1466,'162.209.1.123',1),(245,43,'This is a very interesting concept.  I think it could be a platform where the guest engages with not only Target but also their medical insurance provider (who might subsidize behaviors) and maybe even doctor.  It could be gamified like Cartwheel so the guest is rewarded for great choices.','2015-02-13 22:11:11',1448,'162.209.1.123',1),(246,30,'Love the simplicity of the experience.  A more modern food retail experience.','2015-02-13 22:12:03',1448,'162.209.1.123',1),(247,45,'Love this idea, especially the ability to save my personalized settings and find meals that fit my dietary restrictions.  ','2015-02-13 22:12:32',1455,'162.209.1.123',1),(248,31,'I really like this idea.  I would love to offer this option to guests and feel it would drive more REDcard holders into our stores.  This would be a great way to compete with subscription based businesses.','2015-02-13 22:15:11',1465,'162.209.1.123',1),(249,13,'I like the suggestions to connect with Pinterest activities (recipes, lists, etc) as  well as other leading recipe sites.','2015-02-13 22:15:56',1409,'162.209.1.123',1),(250,30,'I love this - I think this is a great enhancement to what is currently offered and could do especially well in some of our new format stores in areas with lots of foot traffic (City Targets and Target Express).','2015-02-13 22:27:59',1467,'162.209.1.123',1),(251,36,'Love the idea as a guest especially if I can select a meal with minimal prep time but agree that assembling only those ingredients for one meal will be challenging (& expensive) for store TM for a most likely low basket size.','2015-02-13 22:41:30',1455,'162.209.1.123',1),(252,20,'Love it!','2015-02-18 14:23:17',1517,'162.209.1.123',1);
