INSERT INTO `bec_ideas` VALUES (1,23,'CONCEPT EXAMPLE ONLY: Target Trend Tour','College students need to find inspiration to furnish their college dorms, but due to their lack of experience furnishing rooms, they do not know where to start.','Many Guests complained about not being able to find good inspiration for their college dorms. Any inspiration they could find was only available online, making it difficult to gain an understanding of how different home decor pieces come together in real life.','Target Trend Tour is a truck that visits college campuses and exposes college students to room layouts furnished with Target decor items. College students can go into the truck, experience the room, and select online the pieces they would like to buy. Also, every college student who visits Trend Truck is entered to win a full dorm room makeover!','home,backtocollege','','https://www.youtube.com/watch?v=1TPXOgt27e0',0,0,0,'2015-01-19 02:43:30','2015-02-03 08:26:59',0,1,80),(2,23,'CONCEPT EXAMPLE ONLY: Target Launch','Emerging product entrepreneurs are capable of coming with some of the best product innovations, but they struggle to get their products to market due to inexperience and a lack of resources, causing significant delays when trying to serve their target customers.','Entrepreneurs cited frustration understanding how to develop and source their products. When asked about trying to get their products in retail locations, they didn\'t know where to even begin when it came to getting in touch with retailers.','Target Launch will provide entrepreneurs with the resources and mentorship they need through a nurturing relationship to help them develop their product, build their company, and bring their innovative solution exclusively to Targets everywhere.','productinnovation','','',0,1,0.853846,'2015-01-19 03:01:17','2015-01-19 03:01:17',0,1,111),(3,23,'test','test','test','test','wellness','namue.kata@target.com','test',0,1,0.833333,'2015-02-03 08:16:55','2015-02-03 08:16:55',0,1,5),(4,122,'Cart Meals â€“ Curated Healthy Recipes on Carthweel','Moderate and Proactive Demanding Enthusiasts are deeply concerned with healthy eating decisions, but struggle to consistently make these right choices due to lack of proactive investigation, fear of higher prices in healthier food options and limited interaction on accepted mediums at point of conflict, causing detrimental choices related to food quality.','Moderate and Proactive Demanding Enthusiasts identified two major obstacles in their wellness journey, specifically as it relates to healthy meals:  Time and Cost.  Lack of available time to proactively research meal options is an issue due to these guestâ€™s increasingly prioritized obligations, including busy work hours, social events, school and family obligations to name a few.  Even when time allows, the cost of healthy food is another concern.  These guests went as far as to say that healthy food options are often unaffordable.  They struggle to find inspiration in a timely manner at a reasonable cost.','Cart Meals utilizes the widely-accepted and popular Cartwheel platform to provide curated, healthy recipe options to these Moderate and Proactive Demanding Enthusiasts at a point of great conflict â€“ the ill-prepared grocery store visit.  Cart Meals healthy recipes are comprised exclusively of products listed on the Weekly Ad or Cartwheel and are redeemable with one-click, providing a path of least resistance to the guest to address time constraints while going easy on their wallet and pushing them closer to healthier food choices.','CHALLENGE2,WELLNESS','','https://vimeo.com/118722012',2,21,2.35823,'2015-02-04 05:46:21','2015-02-05 06:19:21',1,1,181),(5,147,'Just For You Portable Health Guide','Many younger Target guests donâ€™t have healthy role models to from whom they can learn how to eat and live well.  Some Target guests are confused by conflicting information about what is â€œhealthyâ€, or are overwhelmed by the sheer volume of information about health and wellness currently available.  Still other guests want to make positive changes to improve their wellness, but donâ€™t have the time or patience to sort through volumes of information in order to make the decisions that will lead them down the path of good health.   The Just For You Portable Health Guide addresses all of these barriers to improving personal health and wellness.<br /><br />','A new college student who is living apart from her family for the first time needs to learn how to cook healthy meals for herself and how to eat an overall healthy diet.  But growing up, her parents and grandparents focused on buying food that was inexpensive versus healthy; so now as a young adult on her own, she isnâ€™t sure what â€œhealthyâ€ food really is.  She has tried to do some research on the topic, but finds conflicting information that ends up making her feel frustrated and confused; and with her college classes becoming more demanding, she needs to focus more on her course load and less on food research.  <br /><br /> A middle aged adult has always prided himself on being active and healthy; he has played sports all of his life, and eats a mostly nutritious diet.  But as research continues to define which foods really support wellness, he finds himself questioning some of his knowledge and choices.  For example, heâ€™s not sure if Greek yogurt is really worth the hype, if vitamin supplements are necessary, etc.  Heâ€™s also noticing that over the past few years, he has started to gain a little weight â€“ which was never an issue for him before.  Heâ€™s not sure what changes he should make, but knows that he needs to do something if he wants to remain in good shape in the years to come.<br /><br />','The Just For You Portable Health Guide is a mobile tool that allows a guest to select specific elements of health that they want to focus on â€“ everything from losing weight, to lowering blood sugar, to increasing bone density, to reducing cholesterol, and on and on.  In the store, when the guest comes across an item that they arenâ€™t sure supports their specified health goals, they simply scan the itemâ€™s barcode, and receive instant feedback on whether the item is a good choice, or if there is a better alternative close by.  The just-in-time information instantly clarifies if the item in question supports good health (as defined by the guest), and eliminates the lack of role models or gaps in knowledge of what â€˜healthyâ€™ is compared to the ever-evolving research and resulting information.  Because the guide is so simple to use and provides immediate results, a guestâ€™s patience isnâ€™t strained, and their already hectic schedule isnâ€™t negatively impacted.<br /><br />','WELLNESS,CHALLENGE1,PERSONALIZATION,MOBILE,CUSTOMIZED,JUST-IN-TIME,FLEXIBLE,FAST,CONFIDENCE,EASE,INSPIRATION','','',2,32,2.27064,'2015-02-05 04:02:34','2015-02-05 04:04:38',1,1,180),(6,129,'Well. Done!  Fresh-prepped meals boxed at your local Target.','The market is flooded with unhealthy but convenient dinner options whether you eat in or out.  Parents with little time and/or skill still want to cook wholesome and complete meals for their families.  Ready-to-cook options are often full of preservatives or have had much of the taste frozen out of them.  When a healthy meal is cooked at home it usually requires advance planning â€“ what to make, ingredients to get, thawing meat in time, etc. There exists a need for fast, fresh home-cooked meals that are uncompromising in taste, quality and nutritional value without having to think too hard about how to accomplish it.','Ask anyone what the biggest barriers to consistently offering healthy home-cooked meals are and the answers will invariably center on time and cost.  As Gina D put it, â€œIt takes time to plan healthy mealsâ€¦and cook.  This occurs in addition to work, studying and family life.â€  The perception that healthy food is always more expensive is also pervasive.  Lauren says, â€œProduce and healthy perishable food is so expensive that I canâ€™t afford itâ€<br /><br />\r\nOnline options such as Blue Apron and Plated aim to fill this gap by delivering fully boxed and pre-portioned gourmet meals right to your door via a subscription service.  While they are scoring high marks for taste, quality and nutritional value, their current price of $10-15 per plate is steep considering you still have to cook the meal.  <br /><br />\r\nWith Targetâ€™s scale there is an opportunity to fill this whitespace with healthy and affordable meals.','Guests simply order via a standalone app or an integrated feature within the current Target app.  They select the number of plates, dietary restrictions and the type of food theyâ€™re in the mood for.  A curated list of recipes appears with an associated cost/plate.  All meals are guaranteed to be well-balanced in nutritional value.  Once the order is complete, the local Target store received the order and begins to box up the necessary ingredients for the guest to complete the recipe.  Fresh meat, produce and spices are all pre-portioned and ready to for the guest to use.  Nothing is frozen, pre-packaged or pre-cooked.   This is not Mix & Match â€“ these are curated gourmet recipes using fresh ingredients that regularly rotate at your local Target. <br /><br /><br />\r\nOnce in the store the guests collects his/her box at the deli counter and heads home to cook.  Alternatively, guests could also order in store at an ipad station and continue their shopping trip while the box is assembled. They simply pick it up before completing their trip.  <br /><br />\r\nOnce at home guests simply follow the easy full-color recipe card to make a fresh, gourmet, and most importantly healthy home-cooked meal for their family.  <br /><br />\r\nIf you want dinner done well â€“ order it Well. Done!','Challenge1,Wellness','Neal.Anderson@target.com,Anne.Halverson@target.com,Daniel.Rose2@target.com','https://www.youtube.com/watch?v=Iz-aCAsXNIQ',4,32,2.73214,'2015-02-05 05:05:14','2015-02-05 05:13:57',1,1,307),(7,134,'Driverâ€™s Seat: The app that syncs the authenticity of healthy recipe discovery with the benefits of Targetâ€™s promotional vehicles.','The core consumer (Elizabeth) aspires for a sense of balance in her life and control over her familyâ€™s and her own well being.<br /><br /><br /><br />\r\nShe aims to instill healthy eating habits on her family, but as the primary grocery shopper and meal preparer, she is intimidated by the perceived time and money associated with healthy cooking, as well as her lack of knowledge on healthy eating.','Core consumers cited frustration that it is hard to eat well on a budget. There is a gap between discovering a healthy meal solution, identifying how much it will cost, and locating an affordable destination where she can go to get all of the needed ingredients.','Driverâ€™s Seat will allow her to discover a proactive, easy, and rewarding way to tweak her shopping routine to instill healthy eating habits on her family, and have greater control over their well being.<br /><br /><br /><br />\r\nBy highlighting nutritional and monetary benefits, and providing clarity and transparency for how she can save time and money, she will gain that sense of balance and control that she has been aspiring to achieve.  (Check out the video below to see Elizabeth navigate the app!)','Challenge2,Control,Balance,Wellness','','https://vimeo.com/118705167',3,28,2.69072,'2015-02-05 08:33:49','2015-02-05 08:38:09',1,1,161),(8,142,'Easy Eats: save well, eat well, be well','Dana has a family and is digitally connected â€“ using her smartphone to find tips and ideas for living a healthy lifestyle.  She feels like a good parent when she finds healthy food choices for her family, but sheâ€™s overwhelmed with how stressful it can be to find and prepare the right meals AND get to her fitness class.  The effort she puts in leaves her without the time and energy that she needs to focus on the other well-being priorities in her life.','They feel challenged finding time to work, eat healthy AND exercise.  They believe being healthy reduces stress, but they become stressed in trying to be healthy.  Many people donâ€™t understand what foods are healthy, they may not understand packaging, ingredients and nutrition information.  They struggle to find meals that appeal to everyone in the family. They want healthy to be affordable.','Dana will order Target-assembled meals through a user-friendly mobile application.Â  Sheâ€™ll be able to select meals by category (e.g. â€˜low calorieâ€™, â€˜gluten freeâ€™) that are assembled for her, taking the stress out of meal planning and shopping.Â  When assembling her meals, Dana will be able to choose the number of servings, view nutrition information, select sides, and view photos. Â And weâ€™ll take the guess work and research out of healthy by guaranteeing the â€œdirty dozenâ€ are organic. Sheâ€™ll have flexibility to select the date she wants her meal (s) with options like home delivery or deli pick-up at her Target store. Â She can simply pull a meal out of the fridge and serve or bake it, allowing her to focus on family.Â  Sheâ€™ll spend less time looking for recipes, shopping for ingredients, and preparing dinner and more time for fitness and her other well-being priorities.','WELLNESS,CHALLENGE1','bonnie.vig@target.com,melanie.majerus@target.com,laura.deshler@target.com,michael.neiman@target.com,mandy.daneman@target.com,scott.heilman@target.com','http://itgtsites.target.com/personal/z048788/SitePages/bullseyecrowd.aspx',2,22,2.44557,'2015-02-05 09:23:16','2015-02-05 10:16:51',1,1,116),(9,114,'a','a','a','a','a','','a',0,0,0,'2015-02-05 09:45:57','2015-02-05 09:45:57',0,1,0),(10,87,'Organic Food Finder','<strong>***To skip the description and get right to the video, click the vimeo link at the bottom of the page. Use the password: crowd***</strong><br />\r\n<br />\r\nMany of our Guests care about organic and natural groceries, but donâ€™t realize how many options Target actually carries, because those items are spread outâ€”essentially â€œhiddenâ€ amongst all our other products throughout the grocery department. As a result, we believe many of them have to make an extra trip to Whole Foods for just a few organic items to finish their shopping list. This increases their budget for groceries and the number of items on their \"To-Do\" list. Getting everything they need at Target, in one place, saves time and money.','Guest Insights research indicates that millennial guests often prefer organics, and care about how their food was produced. We have an opportunity to earn credibility in this area, and help them find more of these items at affordable prices during their regular Target run. <br /><br /><br />\r\nIndustry researcher, Farnoosh Torabi of Yahoo Shopping conducted a study comparing the organic shopping experience at Whole Foods and at Target, and pointed out that, \"Nearly half of the 250 items in Targetâ€™s Simply Balanced line is organic, but to be honest it wasnâ€™t so easy to locate what we were looking for in the store.\" <br /><br /><br />\r\nOverall, her recommendation to the millennial audience is that, \"If youâ€™re committed to eating organic and want the best selection, Whole Foods is your best bet. There are plenty of organic products within their 365 Everyday Value brand and itâ€™s organized in a way thatâ€™s easy to find.<br /><br /><br />\r\nBut if you love one-stop shopping at a discount retailer and want to sprinkle some organic food in your diet, Target works.\"<br /><br /><br />\r\nTarget is less expensive and has the product selection she\'s looking for. We just need to help her more easily find it.','Guests can use our \"Organic Food Finder\" in the Target app to view their Target store through an organic lens, which filters out everything but organic food items and shows their exact placement in their store on an intuitive map. <br /><br /><br />\r\nIt also raises her awareness of our organic product selection, and eliminates her need to make an extra trip.','wellness,challenge1','travis.christie@target.com,mark.lofthus@target.com,anne.mezzenga@target.com,carmen.lloyd@target.com','https://vimeo.com/118852191',14,84,2.89286,'2015-02-05 09:52:33','2015-02-06 08:10:22',1,1,465),(11,114,'a','a','a','a','a','','a',0,0,0,'2015-02-05 09:54:14','2015-02-05 09:54:14',0,1,1),(12,114,'ClickCart','<br />***PLEASE WATCH VIDEO AT BOTTOM OF PAGE*** (password: crowd)<br /><br />The Target guest has an overwhelming amount of healthy ideas and inspiration, but due to lack a socially integrated retail experience, has trouble making these recipes come to life.<br /><br />ClickCart is the first platform to combine:<br />- Social Media Inspiration<br />- Online Grocery Shopping<br />- Pick up in store technology<br /><br />','<br />Majority of consumers:<br />- Use social media apps<br />- Enjoy cooking healthy meals<br />- Appreciates the convenience of online shopping<br />- Pins recipes on Pinterest and follows social media posts, but rarely brings the recipes to life<br />- Would make Target their primary store if pick up in store or delivery was an option for groceries<br /><br />','<br />1. Find inspiration on social media<br />2. Click â€˜Add to Cartâ€™ to add to Target.com shopping cart<br />3. Customize selection and checkout<br />4. Pick up the groceries in store at your convenience<br /><br />','challengetwo,digitalenthusiast,pinterest,inspiration,wellness,socialmedia,pickupinstore','colby.lowrey@target.com,whitney.walker@target.com,colleen.r.darby@target.com','http://vimeo.com/118851056',31,177,3.44118,'2015-02-05 09:56:42','2015-02-06 02:14:34',1,1,1231),(13,66,'Target Chef','****Please see our video using the link at the bottom or going directly to https://vimeo.com/118864856 (password=\"crowd\")*****<br />\r\n<br />\r\nMeet Jane, a busy, young professional mother of two, who is passionate about living well. She strives to reduce her stress, spend quality time with her family and provide healthy meals for them. She gets overwhelmed with the entire process of planning and preparing healthy meals, which takes away from her ability to spend time with her family. She becomes paralyzed by the countless recipes on the internet that have too many ingredients or are so complex they take hours to prepare.  As a result, she resorts to the same (not so healthy) meals she always prepares which require less creativity, effort and money.<br />\r\n<br />\r\nShe needs to be able to prepare a healthy meal in a stress-free way and spend quality time with her family.','Busy moms that want to prepare healthy meals but the time involved and the complexity of actually preparing the meals is difficult.  Recipes are one of the most googled search terms.  There is also a knowledge gap of how to cook a healthy meal and a perception that healthy doesnâ€™t always equal delicious.  Per guest insights, â€œAcross all segments, motivation is the top barrier to wellness.  Cost and time are also validated as key friction points.â€  â€œAll segments struggle with eating well consistently and feeling like they have room to improve.â€  <br />\r\n<br />\r\nIn the marketplace we observed multiple options to satisfy different parts of this need.<br />\r\n<br />\r\nWhole Foods - From a retailer perspective, Whole Foods has an app that adds to a shopping list, but it doesnâ€™t calculate cost and the shopping list isnâ€™t user friendly.  <br />\r\n<br />\r\nBig Oven - another app that lets you search recipes and make filters, adding items to your meal plan and eventually your shopping list.  The app is not tied to a retailer or specific items, and doesnâ€™t show you the value you will get.  There is also no store pickup or home delivery, some of the menu options are difficult to make, and it only addresses planning the meal, not shopping or preparation.<br />\r\n<br />\r\nHello Fresh - a subscription service that allows the consumer to choose from five recipes each week and you have to choose exactly three.  The recipes are simple and easy to prepare and there is home delivery.  The meals themselves are at higher price point and if you like a meal it wonâ€™t necessarily be a choice the next week.<br />\r\n<br />\r\nMost options in the market are not focused on simple, healthy meals unless consumers are willing to pay a premium.','Plan - Sheâ€™ll download the app for free, register (unless she already has Cartwheel or Target.com account), then she gets to choose her meals (from a few choices, trending dishes, 4 star or higher).  There is a filter for food allergies and special dietary needs.  All meals are healthy, easy to cook and prepared in 30 minutes or less.<br />\r\n<br />\r\nGrocery shop - Her grocery list is created from the meal selections and the app selects Target grocery items that exist in the store.  She has the option to remove any ingredients from the list if she already has them.  The Cartwheel button at the bottom populates any available coupons, and then calculates the cost of her grocery list.  If she wants to shop in store, the grocery list will display aisle locations.  If she doesnâ€™t want to shop in-store, she can click buy now and the groceries will be ready for pickup at a set time.  A home delivery option is also available for her convenience.<br />\r\n<br />\r\nPrepare - Simple step by step instructions and pictures guide her through the meal preparation.  Itâ€™s so simple her kids can cook the meal.  She has the option to rate, share and favorite the meal, which creates a feedback loop and continues to personalize the experience.','wellness,challenge2,healthymeals,simplyhealthy,targetchef','Fia Wulur,Peter Staloch,Spencer Wiggins,Tracy Johnson,Ylan Kazi','https://vimeo.com/118864856',28,179,2.95312,'2015-02-06 12:33:23','2015-02-06 12:36:23',1,1,1312),(14,126,'Connected Care','****** PLEASE WATCH OUR VIDEO IN LINK BELOW ********<br /><br />\r\nWhile moms do everything in their power to keep their children healthy, they worry about those moments of the unknown. Whether an expecting mother wonders when she last felt her babyâ€™s kick or her infant cries inconsolably at 3AM, there are so many moments where mom aspires for peace of mind that everything is okay.  She struggles with the stress of the unknown and wonâ€™t rest until she can diagnose or treat her children, even if itâ€™s ahead of her own needs.  She needs the tools to act in those moments, ultimately empowering her and delivering her the peace of mind she needs.','When engaging with Target Guests, it quickly became abundantly clear momâ€™s biggest source of stress and anxiety was worrying about the health of their children. People spent hours searching online, consulting with close confidants, or traveling to and from doctorâ€™s offices for common treatments, all in search of peace of mind. We found the gap was empowering mom in her moment of need instead of taking the time to search out third party sources. Mom stresses in the moments where she lacks control of her childâ€™s health and wants the tools that empower her at that time.  Regardless of her childâ€™s age (Prenatal, Infant, Toddler, etc), she yearns to quickly control that anxiety and obtain greater peace of mind through quick diagnosis and care of her children.','Today, we know that moms are visiting Target for their own and their families over-the-counter healthcare and Pharmacy needs.<br /><br />\r\nTomorrow, she will be able to rely on Target for new, innovative health care technology products that empower her to diagnose, monitor, and care for her children, regardless of age. For example, an expecting mom can use a new product to check her babyâ€™s heartbeat and share a recording with her family and friends.  Similarly, she can check for an ear infection, upload to a doctor, and pick up her prescription at a Target pharmacy without visiting a doctor\'s office or waiting room. Finally, she will be able to monitor her childâ€™s fever in real-time during their recovery.   <br /><br />\r\nMost exciting, she does not know that these products exist and are available to help her.  She will engage with Target in a whole new way through interactive education, engagement with Pharmacy, and Target.com.  Due to the newness, we will fuel her exploration through perfect placement displays and an interactive experience.  Ultimately, these products will empower her and make Target her trusted destination for wellness throughout any of her familyâ€™s life stages.','ChallengeOne','anne.steeves@target.com,Monica.Saracino@target.com','https://vimeo.com/118637383',4,32,2.29339,'2015-02-06 03:14:07','2015-02-06 03:23:16',1,1,164),(15,149,'PowerChips -  Move, Earn, Game','We know that physical activity produces overall physical, psychological and social benefits, and that inactive children are likely to become inactive adults (from NFL Play60).  Many children spend their inactive time playing video games and apps.  While some game makers have attempted to increase the amount of movement involved in playing their games (Wii, Kinect, etc.), the amount of physical activity involved in playing these games is minimal.  There exists an opportunity to better connect active play with video games, a way to encourage the young gamers to get up and play in the real world.  The PowerChip Active does just this, by tracking the amount of time the child is actively moving during the day, the child earns in-game rewards, called PowerChips.','Nathan, a 9 year old boy, loves to play video games, where he immerses himself in worlds where building and exploring, beating challenges, and gathering â€œcoinsâ€ allow him to level up, gain new challenges, and customize his world and characters.  When asked about why he likes to spend so much time in the games, Nathan answers, â€œI just want to see what is nextâ€.<br /><br /><br /><br /><br /><br /><br />\r\nBecky, Nathanâ€™s mom, knows the importance of active play, but struggles with the Nathan to get him up to do it.  Just getting him off of his games is seen as a punishment.  She wants her kids to WANT to get up and play.','Kids simply clip the PowerChip Active onto their clothing or hold it in their pocket.  The Chip is activated whenever the child moves, tracking the amount of time that this movement is happening (a minimum of 5 minutes of activity is required to â€œcountâ€ and be tracked).  They then connect the PowerChip Active to a PowerChip Sync Tower that recognizes the amount of (new) time tracked and adds it into a PowerChip bank within their game system.<br />\r\n<br />\r\nThrough partnerships with video game and app designers, PowerChip rewards are added into their new games, with exclusive rewards for â€œpurchaseâ€ with PowerChips (power and ability upgrades, new missions or challenges, new skins and clothing, and other special customizations).<br />\r\n<br />\r\nWith the PowerChip Active and video games and apps with the embedded PowerChip currency, kids earn the gaming experience they love by getting the physical activity that they need.','challengeone,wellness,active kids','','',5,24,1.31707,'2015-02-06 03:30:27','2015-02-06 03:37:26',1,1,87),(16,112,'Well by Target. Mobile Fitnessâ€¦Anytime','For time-starved individuals who want to maintain a workout routine without taking time away from other meaningful activities, Well by Target provides conveniently scheduled, capacity-controlled classes that you can join with your friends from anywhere you are, with a live trainer able to give you real-time feedback.','Driving to and from fitness classes takes time. Being surrounded by ultra-fit classmates wearing expensive workout gear can be intimidating. Workout videos can become stale and uninspiring. Fitness routines can be hard to maintain if you do it alone, without support systems. <br />\r\nWell by Target removes the inconveniences and insecurities brought about by traditional fitness classes, while keeping you motivated with personal attention from your instructor and support from your friends.','Log on to Well by Target and select a scheduled workout that interests you, a certified trainer you\'d like to work with, or find one that your friends have already signed up for<br />\r\n<br />\r\nJoin at the scheduled time and stream the class live to your laptop, mobile device, or TV. Enable your own video to get additional pointers and feedback from your live instructor.<br />\r\n<br />\r\nGet fit and chat with your friends about that last workout, or join communities to hold each other accountable.<br />\r\n<br />\r\nTrack your fitness goals and start earning Target rewards.','WELLNESS ,CHALLENGE1','blake.williams,stephanie.alcivar@target.com,jeremiah.iacarella@target.com,neal.tsay@target.com,christine.johnsons@target.com,mee.yang-lee@target.com','https://vimeo.com/118858027',4,32,2.47119,'2015-02-06 04:39:48','2015-02-12 04:00:26',1,1,133),(17,188,'Target Plate','Our guest Taylor tries her best to live up to her values and ambitions by eating healthy, sustainable food, but with a busy schedule and no culinary training, she lacks the time and expertise to prepare meals that match her aspirations and tastes. She is also overwhelmed by all the food options available to â€“ both when choosing where to shop and eat, and when shopping the aisles of Whole Foods or Target. As a result, she often ends up settling for meals that are uninspiring, unhealthy, and/or expensive. Target Plate allows Taylor to have it all: healthy, delicious, sustainable food at an affordable price that fits into her busy schedule.','Taylor is faced with the challenge of eating healthy, delicious, sustainable food, while also leading a busy lifestyle and managing her budget. Many consumers fall victim to this dilemma and often end up settling for meals that are uninspiring, unhealthy, and/or expensive.','One night, while watching Jimmy Fallon, Taylor sees a hilarious cooking segment featuring celebrity chef Jamie Oliver highlighting his new partnership with Target.  He is showing how Target guests can conveniently pick up a pre-packed Target Plate box with all the necessary ingredients to prepare the healthy, delicious meals.  Jaime also records the shows where he prepares each box so that guests can watch his video while learning how to prepare their meal.  Alternatively, Taylor could just as easily have discovered through the cool, new interactive Target Plate kiosk or when she noticed her friends repining the Target Plate recipes on Facebook.  The interactive kiosk allows her to sign-up for Target Plate, customize her dietary preferences and learn about her food choices.  <br />\r\nTaylor is delighted to discover how quick and easy it is to stop by a Target store, pick up her Target Plate box, and use the healthy, fresh contents to prepare a delicious meal at home, all while being guided by Jamie Oliverâ€™s Target-exclusive web episodes and digital recipes that show her how to prepare the meal.  She looks forward to her Target Plate box next week and plans to incorporate it into her weekly routine.','WELLNESS,CHALLENGE2','gregory.gausewitz@target.com,Isaac.Borofka-Webb@target.com','',4,27,2.7,'2015-02-06 05:02:26','2015-02-06 05:02:26',1,1,149),(18,200,'Wellness ONE SCAN Plan  - Please view URL: https://sway.com/fFmO4Vi0rzEHw87o','Consumers that are looking to track their food purchases and financial history can do so with one barcode scan.','Consumers are using a multitude of apps such as Mint, WellsFargo for personal banking to view expenditure.  They are also using food journals such as myfitness pal and fooducate to track and score food.  This is time intensive and requires using multiple apps.  Many consumers want better tracking to start better behavior.','Consumers can scan products to create and upload their food lists, while adding relevant cartwheel savings to their barcode. <br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nAfter uploading the lists they monitor week by week spending and food behaviors.  They can also set goals within food plans if they want to adhere to a certain diet plan, like paleo, to see how their purchases align to the plan.','challengeone,wellness,barcode,onescan','','https://sway.com/fFmO4Vi0rzEHw87o',7,20,1.72603,'2015-02-06 06:46:18','2015-02-06 07:37:24',1,1,134),(19,190,'Financial Wellness-  Saving plan for families by using their RedCard','Financial saving for college is a task that is always on \'the list\'.  This program will start and consistently add funds to the childs post secondary education and make saving money an easy process.','I observed, parents sharing their support for education and wanting to save for their childrenâ€™s college fund.  They all said, it was on their list to get to.  Families are saving less than $16,000 by the time the child attends college. Education saving plans are not publicized, but one time a year.  The cost of post-secondary school is rising, prohibiting many students from attending college.','The guest will sign up online for a state sponsored education savings plan.  They will connect the Target RedCard to their account.   As guest make purchases at Target, 1% of their purchases will be automatically applied to their education savings account.  If a family does not have children, they could set up the account to go to the Target Scholarship fund, which would support individual and post-secondary organizations.','financial wellness,college,RedCard','','https://www.dropbox.com/s/h6yfm5jsgehgdjl/Target_Wellness%20v1_1.mp4?dl=0',0,0,0,'2015-02-06 06:51:35','2015-02-06 06:51:35',0,1,4),(20,110,'Target EZ Meals','Meet Ben, a recent college graduate who is now tossed into the real world where magical dining halls and college days of ramen don\'t exist anymore.  Ben has been living off of frozen foods and takeout for months because he can\'t cook.  After feeling the impact of his food choices causing him to have less energy at work - not to mention his hurting wallet - he has decided to make a change.  He wants to create his own meals and save money while he pays off his college loans.','The overwhelming majority of people interviewed mentioned eating well as their primary obstacle to physical health.  The main roadblock was the inability to cook, followed by the perception that healthy foods are more expensive.','Our Concept is Target EZ Meals.<br />\r\nIt is a cellphone app that has a built in recipe book.<br />\r\nUnique to this recipe book is that it links with Target pricing info to know what items are on sale (Circular, TPCs, etc).<br />\r\nThe App allows the user to drill down into recipes based upon main ingredients (suggestions based on weekly deals), number of servings, preparation time, as well as nutritional value in a number of categories.<br />\r\nAfter a person selects their recipe in the app, the app directs the person to the location of the ingredients in the store and tells them the total price of the ingredients used in the recipe.<br />\r\nThe intended audience is people who do not know how to cook and/or want to save money.','challengeone,wellness,Savings,QuickMeals,HealthyMeals,TargetEZMeals','Natalie.Fang','https://www.youtube.com/watch?v=_LENjx5XgCU',17,90,2.90596,'2015-02-06 07:41:49','2015-02-09 03:34:54',1,1,545),(21,101,'Target Neighborhood Events (TNE\'s)','The Target guest is searching for free and convenient community events & activities that can educate, inspire, and engage  their families while helping them to make smarter choices about the things they feel support their wellness.  Target is searching for ways to integrate our 1800+ neighborhood stores into the community to help drive store traffic and make Target a destination for the guest.','The Target guest has an abundance of shopping choices (both online and in brick & mortar) and yet they often are confused about how to make the best choices to improve their families wellness while they shop.  They are looking to experience and be educated/inspired by wellness solutions that Target can offer.','By periodically sponsoring local community events in under-utilized Target store parking lots,  Target Neighborhood Events (TNEâ€™s) would draw local residents to the 1800+ Target store parking lots.  Once there, the guest and their families would participate in locally-customizable events and activities that support improved wellness and community spirit such as partnerships, for example, with local Veterinarians and Dept. 083 (pets).  The guest would learn about pet health at the TNE and then would receive special in-store savings on Boots & Barkley pet products for participating.','WELLNESS,CHALLENGEONE','','http://vimeo.com/118880936',5,23,1.77273,'2015-02-06 07:47:57','2015-02-06 07:47:57',1,1,87),(22,260,'It All Starts with a Lemon','Many of our guests want to lead healthier lifestyles but believe that healthier options are too expensive and confusing to navigate. Target can make Wellness accessible to guests by making organics more affordable and acting as a trusted partner to help the guest switch to healthier options. <br />\r\n<br />\r\nPlease watch our video to see how it all starts with a lemon!','We conducted a survey of friends, family and co-workers:<br />\r\n<br />\r\nâ€¢When asked what â€œwellnessâ€ meant to them, most people surveyed stated â€œeating healthyâ€ as a top response. <br />\r\nâ€¢After probing into barriers to eating healthy, many stated prohibitively high prices and the confusing options available.<br />\r\n<br />\r\nThen we conducted some online and in store research:<br />\r\n<br />\r\n-Organic produce costs about 20% more to produce BUT on average organic produce sells for 50% to 100% more<br />\r\n-70% of people who do not purchase organics state price as the #1 barrier <br />\r\n-See images for instore research','Target will start by making a Wellness Price Guarantee by taking organic prices down to ideally be 20% or less price premium over traditional counterparts. Target will promote its Wellness Price Guarantee through marketing channels. <br />\r\n<br />\r\nTo assist the guest in developing healthy habits, we will offer Cartwheel Wellness Challenges within the Cartwheel app that will help the guest navigate healthy options and lead to healthier habits. When guests opt in to the Wellness Challenge, an example of a challenge is to scan a grocery item (for example, a lemon) and Cartwheel will suggest an organic or healthier option (an organic lemon) where available. If they purchase the healthier item on that trip, they will get the healthier item (organic lemon) for the price of the original item (lemon) they scanned.<br />\r\n<br />\r\nIf the guest starts accepting Wellness Challenges by buying healthier grocery items, Cartwheel will continue to prompt them to try healthier items throughout grocery (organic beef), and eventually in other areas of the store (natural beauty products, multivitamins, organic cotton sheets). <br />\r\n<br />\r\nBy taking a small step like purchasing an organic lemon, the guest starts her journey of trial into healthier options throughout the Target store and will realize that Target is the one stop shop for all her Wellness needs and the small price premium is worth the health benefits for her family.<br />\r\n<br />\r\nPlease watch our video to see how it all starts with a lemon!','challengetwo ,wellness','marissa.paulson@target.com','https://vimeo.com/118947116',14,54,2.83696,'2015-02-06 08:08:21','2015-02-06 08:08:21',1,1,268),(23,118,'Target Steps','*Please view video (link at the bottom)<br /><br />\r\nEmily is a busy new mom. Her day is constantly filled with numerous choices. Should she let her baby sleep a little longer or wake her up and run to Target? Should she volunteer or make it home to put her baby down for nap time? Clip coupons or put together that new toy? This can be very demanding. While she knows how important it is for her to fit exercising and finding more ways to save money into her day, this just isn\'t currently possible. Emily wishes there was a way to integrate these healthy behaviors into her already full day and model them to her baby while taking some of the guesswork out of deciding how to fit them in.','When connecting with and observing numerous Target Guests, it was clear that they see the importance of exercising, saving money, and giving back. Unfortunately, many of our guests lack the time and/or the motivation to pursue these healthy behaviors. In terms of exercising, they are already looking for ways to fit this into their every day (i.e. through wearing a Fitbit, Jawbone, etc.). They want a seamless experience that integrates each of these healthy behaviors into their busy lives and then be able to share what they are doing with their friends via social media.','Target Steps is an app easily located within the Target App. As Emily visits Target, with baby in tow, Target Steps automatically tracks her steps (through GPS), earning her money along the way. She can then spend her earnings on reducing her bill, save her steps towards a badge in Cartwheel, or give her earnings to the charity of her choice. She can also earn money for her activity outside of Target and decide whether to spend, save, or give those earnings. <br />\r\n<br />\r\nEmily can also share how much she has earned walking by inviting friends to use the app and show them how far she has gone, giving her that extra motivation to set wellness goals and keep them. By integrating more exercise, saving money, and giving back to the community into her already busy day, Emily can feel confident that she is modeling these healthy behaviors to her baby and caring for her own health at the same time.','wellness challenge3','Suzanne.Chinnock,Jake.Turner','http://redcast.target.com/training/?contentID=R1ixsWtiHUCGmDselDw-BA',6,37,2.47686,'2015-02-06 08:14:53','2015-02-06 10:01:09',1,1,166),(24,54,'Sports Specific Nutrition','Not all calories are created equal, especially when we think about sports and performance.  Parents have the motivation to help their kids advance their athletic performance but donâ€™t have the knowledge.  We want to enhance our/our childrenâ€™s performance rather than simply filling our/their stomachs.','I experienced parents that felt guilty and confused.  They had children in sports but didnâ€™t know how to feed their kids to support the daily practices and games.  Theyâ€™ve given up on sugary sports drinks and performance supplements (bars, gels, etc).  Their kids need real food but what does that mean and does a football player need different meals than a cross country runner?','(1)	Sport/Activity specific meals that are easy to identify<br /><br /><br />\r\n(2)	The right blend: Protein, Fats, Carbs and Vitamins<br /><br /><br />\r\n(3)	Prepared fresh: at Target with Target sourced products<br /><br /><br />\r\n<br /><br /><br />\r\nConsumers can have an experience with these meals in a variety of ways:  <br /><br /><br />\r\nParent â€“ eliminates confusion (premade, easy to identify sport meals, prepped at Target) while expanding knowledge (label with ingredients and ingredient percentages)<br /><br /><br />\r\nUser â€“ healthy performance enhancement and encourage life-long healthy eating (routine and accessible ingredients). <br /><br /><br />\r\nCoach/Nutritionist â€“ submit customized meals based on athleteâ€™s needs and goals.','challengetwo,sports,performance,organic,allnatural,athletes,nutrition','','',0,0,0,'2015-02-06 08:38:01','2015-02-06 08:43:08',0,1,4),(25,32,'Target Wellness Program','Video URL: https://vimeo.com/118947634<br /><br />\r\nOur end user is Scott, a health-conscious, millennial father and family budget owner who often puts his family needs ahead of his own. He loves Target, loves to shop, and loves finding a good deal.<br /><br />\r\nScottâ€™s definition of wellness is maintaining â€œholistic balanceâ€ in his life which incorporates everything from healthy eating and regular exercise to spending quality time with his family. Though, in Scottâ€™s words, â€œExercising regularly and eating healthy foods are the two biggest components of wellness for me.â€<br /><br />\r\nScott needs a way to help provide consistent, holistic, balanced wellness for himself and for his family. But frustratingly, he struggles to find the personal motivation to consistently exercise and also the ability to provide more affordable, healthy food options for his family.<br /><br />','Scott told us, â€œI donâ€™t always have time to work out with my busy schedule.â€ But after observing his behavior, we discovered that despite his busy schedule, lack of motivation was actually the biggest barrier preventing him from exercising on a more consistent basis, NOT lack of time. We also learned that in the past, incentives and social factors have been the two types of motivations that have been most effective in spurring Scott to exercise.<br /><br />\r\nTargetâ€™s Guest Insights research validates this observation, â€œAcross all segments, motivation is the top barrier to wellness. Cost and time are also validated as key friction points.â€ â€œAll segments struggle with eating well consistently.â€<br /><br />\r\nScott also said, â€œIâ€™d like to purchase healthy, natural, and organic foods and produce more often, but these items are usually so much more expensive that I canâ€™t always afford them and stay within my budget.â€ We observed that Scott regularly purchases a variety of snacks and foods for his family, for most of which exist higher-priced, healthier or organic alternatives.<br /><br />\r\nLastly, we also observed how fulfilling it is for Scott to find a deal or receive a discount on a purchase. He often shares his bargain discoveries and how much he saved with close family members and friends.<br /><br />','The Target Wellness Program allows guests to earn discounts on â€œwellnessâ€ items at Target (such as healthy, natural, and organic foods) by completing certain â€œwellnessâ€ activities (such as working out and exercising). With the help of this new program, Scott can both find the motivation to exercise regularly AND afford to purchase healthier foods for his family in order to help them all live more balanced, healthy lives.<br /><br />\r\nItâ€™s Sunday, and Scott is in charge of making dinner for his family tonight.  While evaluating the options, he could just order out pizza again because itâ€™s quick and easy, but he feels guilty that he isnâ€™t providing his family with healthier foods.  Adding to his guilt is the fact that he failed to work out this morning like he had plannedâ€¦again.<br /><br />\r\nScott remembers that he recently downloaded an app that gives deals on healthier food options through Target when he works out.  Scott opens the app and finds an Archer Farms Organic Veggie Pizza and sees he only needs another 200 points to redeem the discount.   Within the app there is also a list of exercises and activities he can do and how many points he will earn for doing each. The points can then be redeemed for any discount he sees. Thereâ€™s even the option to sync up a FitBit and earn points for the activity it tracks.<br /><br />\r\nScott then completes various exercises and tracks them in his Target Wellness Program.  On his way home from working out, he redeems the discount on the Archer Farms Veggie Pizza to make for dinner for his family.  Scott feels a new sense of balance return to his life using the Target Wellness Program to motivate him to consistently exercise, and provide healthy food for his family on a budget.<br /><br />','wellness,challenge1,challenge3','adam.rehberg@target.com,Scott.Meyer','https://vimeo.com/118947634',12,34,2.76378,'2015-02-06 08:39:04','2015-02-06 08:49:32',1,1,214),(26,82,'Wellness Hub','Wellness cannot be summed up by one action alone. For many people it is a sum total of eating healthy, physical fitness and relationships being in balance or a place of peace. Regardless of where the Guest fell on the â€œWellness Spectrumâ€ the recurring theme of the following three basic barriers surfaced.<br />\r\n<br />\r\nLack of information, time and connection stands in the way of achieving wellness.','Moderate: Shannon a stay at home mom, (37, married, 2 kids) strives to maintain a balance of physical, mental and spiritual health by setting small achievable goals and resetting them as her family achieves them. Sheâ€™s teaching herself a more healthy way to cook and feed her family by doing research on the Internet and reaching out to friends and family that she views as healthy. However, being overwhelmed by too many activities makes it difficult to maintain and she slips into old habits; losing the time to research recipes, prep and cook.<br />\r\n<br />\r\nProactive: Sarah a working mother, (36, married, 1 kid) is willing to make multiple stops at different stores in order to purchase organic or from transparent food sources. She seeks out blogs that provide her with healthy recipes, family friendly solutions and exercise routines. Maintaining a planned regiment of daily meals and physical activities keeps her family on track and her migraines at bay. Unfortunately, stress from work makes it difficult for her to maintain and she loses time to plan and prep leading to unhealthy choices for her family.<br />\r\n<br />\r\nBoth Shannon and Sarah confirm the conclusions of the Wellness Fact Pack. They want to eat healthier, improve their physical fitness and maintain balanced relationships. But feelings of being overwhelmed by activities and stress block their path. Both seek out connections with other people who they view as being healthy.<br />\r\n<br />\r\nSarah, the proactive is already shopping in places that offer her the connected or trustworthy source. For example: her local farmers market where she can speak directly with the grower, Trader Joes where the sample person tells her about a lower priced item that is just as good as the more expensive one. Lululemon offers in store yoga class.<br />\r\n<br />\r\nBased on the Macro trend series presented by Target Creative Strategy our demanding enthusiasts want: Unfiltered truth & unwavering values. To co-create, collaborate and be a part of the process. Expect seamless, frictionless, convenience. Data distilled for a more personalized experience. Care about connections and not just transactions. Plus, have self-awareness, a positive image & lasting impact.','At the heart of our stores is the â€œWellness Hubâ€, a flexible space that can change and evolve to meet our Guest where they are at. This space can house Registered Dieticians lecturing, or demonstrating healthy cooking that would feature owned brand food along with take away meal plans and coupons. Fitness experts to demonstrate different workout equipment or consult one-on-one to develop a workout routine for the whole family. Just purchased a new electronic device? Our tech experts can help decipher that new FitBit, tablet, or phone. The stylist can help you find just the right outfit for the job interview, wedding, or even meeting the parents.<br />\r\n<br />\r\nLocalized weekly schedules of the wellness hub are communicated via: email, text messages, on target.com and in-store postings. This would include any special promotions or collaborations.<br />\r\n<br />\r\nWe fullfill our Guests needs when we meet them where they are at.','wellness interconnected','','',6,37,1.83471,'2015-02-06 08:40:06','2015-02-06 08:46:12',1,1,113),(27,54,'Sport Specific Nutrition','Not all calories are created equal, especially when we think about sports and performance.  Parents have the motivation to help their kids advance their athletic performance but donâ€™t have the knowledge.  We want to enhance our/our childrenâ€™s performance rather than simply filling our/their stomachs.','I experienced parents that felt guilty and confused.  They had children in sports but didn\'t know how to feed their kids to support the daily practices and games.  They\'ve given up on sugary sports drinks and performance supplements (bars, gels, etc).  Their kids need real food but what does that mean and does a football player need different meals than a cross country runner?','(1)	Sport/Activity specific meals that are easy to identify<br />\r\n(2)	The right blend: Protein, Fats, Carbs and Vitamins<br />\r\n(3)	Prepared fresh: at Target with Target sourced products<br /><br />\r\nConsumers can have an experience with these meals in a variety of ways:  <br />\r\nParent â€“ eliminates confusion (premade, easy to identify sport meals, prepped at Target) while expanding knowledge (label with ingredients and ingredient percentages)<br />\r\nUser â€“ healthy performance enhancement  and encourage life-long healthy eating (routine and accessible ingredients).<br />\r\nCoach/Nutritionist â€“ submit customized meals based on athleteâ€™s needs and goals.','challengetwo,athletes,sports,performance,organic,allnatural,nutrition','','',7,29,1.53962,'2015-02-06 08:47:36','2015-02-06 09:12:44',1,1,127),(28,16,'jkdjkasjkj','sdjkfsjkdjskdfjksd','dkjksdjksdfjkkj','cjkjksdfjksdfjk','hastags','','jkdsjksdjk',0,0,0,'2015-02-06 08:56:17','2015-02-06 08:57:04',0,1,0),(29,145,'Healthy Corner. It\'s as easy as 1, 2, 3!','Consumers have the desire to eat healthy.  However, due to time constraints and lack of guidance they find it difficult to come up with quick and healthy food options.  They rely on quick meals via restaurants due to their frustration of grocery shopping and lack of diverse and easy meal ideas.','Upon entering the store they become overwhelmed with all of the options and the time it takes to locate items.  As a result they become annoyed with their shopping experience and leave with an empty cart and a personal pan pizza from Pizza Hut in their hand.  Not a healthy way to end the day.','Our concept will provide our guests with healthy meal options both home and in-store.  Target will create a front and center Healthy Corner destination in replacing all Pizza Huts and Target Cafes.  Target will be providing an amazing in-store experience offering 3 stations.  <br /><br />\r\n<br /><br />\r\nStation 1 â€“ â€œTaste and Learnâ€ offering a test kitchen that will showcase chef demos along with taste testingâ€™s of healthy recipes.  <br /><br />\r\n<br /><br />\r\nStation 2 â€“ â€œHelp and Shopâ€ will provide a wall of recipe ideas and a concierge that will quickly assist you by grabbing your recipe items.<br /><br />\r\n  <br /><br />\r\nStation 3 â€“ â€œGrab and Goâ€ gives the guest the opportunity to utilize the grab and go wellness bar for a quick snack or a full meal that they can enjoy in the dining area.  <br /><br />\r\n<br /><br />\r\nThanks to the Wellness Indicator, the guest will become educated on how to take the guess work out of smart choices by informing them of both nutrition and energy information.  <br /><br />\r\n<br /><br />\r\nHealthy Corner.  Itâ€™s as easy as 1, 2, 3.','Challenge1,HealthyCorner,WhiteSpace,InStoreExperience,EasyAs123,RealLife,Wellness','Nicole Middlecamp,Kimberly Moredock,Kate Preston,Sabrina Shairzay','',0,0,0,'2015-02-06 08:57:25','2015-02-06 09:06:54',0,1,3),(30,145,'Healthy Corner. Itâ€™s as easy as 1, 2, 3.','Consumers have the desire to eat healthy.  However, due to time constraints and lack of guidance they find it difficult to come up with quick and healthy food options.  They rely on quick meals via restaurants due to their frustration of grocery shopping and lack of diverse and easy meal ideas.','Upon entering the store they become overwhelmed with all of the options and the time it takes to locate items.  As a result they become annoyed with their shopping experience and leave with an empty cart and a personal pan pizza from Pizza Hut in their hand.  Not a healthy way to end the day.','Our concept will provide our guests with healthy meal options both home and in-store.  Target will create a front and center Healthy Corner destination in replacing all Pizza Huts and Target Cafes.  Target will be providing an amazing in-store experience offering 3 stations.  <br /><br />\r\n<br /><br />\r\nStation 1 â€“ â€œTaste and Learnâ€ offering a test kitchen that will showcase chef demos along with taste testing of healthy recipes.  <br /><br />\r\n<br /><br />\r\nStation 2 â€“ â€œHelp and Shopâ€ will provide a wall of recipe ideas and a concierge that will quickly assist you by gathering your recipe ingredients.<br /><br />\r\n<br /><br />\r\nStation 3 â€“ â€œGrab and Goâ€ gives the guest the opportunity to utilize the grab and go wellness bar for a quick snack or a full meal that they can enjoy in the dining area. The Grab and Go area will also feature a Wellness Indicator, which will help the consumer take the guess work out of making smart choices by informing them of both nutrition and energy information.  <br /><br />\r\n<br /><br />\r\nHealthy Corner. Itâ€™s as easy as 1, 2, 3.','challenge1,wellness,HealthyCorner,WhiteSpace,InStoreExperience,EasyAs123,RealLife','Nicole Middlecamp,Kimberly Moredock,Kate Preston,Sabrina Shairzay','',27,124,2.92974,'2015-02-06 09:21:07','2015-02-27 06:21:41',1,1,751),(31,190,'FINANCIAL WELLNESS:  EDUCATION SAVING PLAN USING THEIR REDCARD','Financial saving for college is a task that is always on \'the list\'. This program will start and consistently add funds to the childâ€™s post-secondary education and make saving money an easy process.','I observed, parents sharing their support for education and wanting to save for their childrenâ€™s college fund. They all said, it was on their list to get to. Families are saving less than $16,000 by the time the child attends college. Education saving plans are not publicized, but one time a year. The cost of post-secondary school is rising, prohibiting many students from attending college.','The guest will sign up online for a state sponsored education savings plan. They will connect the Target RedCard to their account. As guest make purchases at Target, 1% of their purchases will be automatically applied to their education savings account. If a family does not have children, they could set up the account to go to the Target Scholarship fund, which would support individual and post-secondary organizations.','wellness,Financial wellness,college','','https://vimeo.com/118955180',17,62,2.85149,'2015-02-06 09:25:46','2015-02-06 09:25:46',1,1,251),(32,287,'Cartwheel Healthy Connect','Individual health is at the foundation of day to day life; impacting every aspect of life from work to family to recreation, good health is transformative. Yet, acting alone, without reinforcing social and economic environments, no individual can achieve their optimal health. <br />\r\nIt isnâ€™t a simple matter of motivation; the context of peopleâ€™s lives determines their health: income and social status, education, physical activity, social support networks, genetics and access to healthy environments are the true determinants of individual health. <br />\r\nWe know our guests are proactive health consumers who care about the health of themselves and their families. The demographic of our guest (with above average education and above average income) means that many of these determinants of health (such as income, social status, education) are relatively constant but an important problem persists: at the point in time when guests are making choices on products that will impact their health, they lack the key social network and incentive that will reinforce the healthy choice. <br />\r\nEnter Cartwheel Healthy Connect. By harnessing the popularity and footprint of Cartwheel and combining it with behavioral science, Cartwheel Healthy Connect reinforces the guest in making healthy choices by winning on price and winning at health.','There are two parts to this equation. <br />\r\nFirst, the state of the health of America is dire. <br />\r\nâ€¢	64% of Americans are overweight & obese<br />\r\nâ€¢	At least 1 in 4 people eat some type of fast food every day; average fast food meal totals 830 calories, which means in the one meal, people are eating almost half of their daily calories.<br />\r\nâ€¢	This generation of children will be the first in history to not be healthier than their parents.<br />\r\nâ€¢	Diabetes is the fastest growing disease and diabetes medication is the fastest growing pharmaceutical industries in the market.<br />\r\nSecond, behavioral science has consistently found that health is contagious. The health of one individual impacts the health of their friends and family. This fact is at the foundation of successful population health efforts: to improve the health of the whole, the network and environment of the individual must be harnessed. <br />\r\nAs humans we are born to follow, we are suckers for advertising, deals, and the easiest way to get our results.  Health improvement isnâ€™t easyâ€¦ when we try to make major changes.  BUT, when we take health improvement in small doses, easy steps, and with othersâ€¦we prevail!','The consumer will experience Cartwheel as it is today with enhancements. Guests can identify 3 people to be in their â€œCartwheel Circleâ€. Across categories, from produce to C9 to owned brands and wearableâ€™s, the more healthy choices each individual makes within the Circle makes, the more rewards each individual earns. <br />\r\nGuests within a Cartwheel Circle are rewarded with fixed rewards (like those in todayâ€™s app) and then can earn variable rewards (surprise and delight); these are unexpected incentives like gift cards and free coffee.  These two reward types are proven to motivate even the unmovable and grasp the hearts of the demanding enthusiasts.<br />\r\nCartwheel Healthy Connect is the first behavioral health aggregation platform that rewards the health of you and those you love.  Cartwheel Healthy Connect can literally change the population health footprint!  Target can drive access; health literacy, and motivation just by connecting family, then friends, then community.','Wellness,Health,Community,Discounts,Family,Challenge1,Cartwheel','cara.mcnulty@target.com,aileen.guiney@target.com','',5,42,2.80132,'2015-02-06 09:40:51','2015-02-06 09:40:51',1,1,171),(33,73,'Target Wellness','Sam is a 24 year old young professional from a home that did not value healthy habits, but Sam does. Sam wants to be healthy and eco-friendly but does not know how to start, nor has the time, inspiration, or resources. Sam needs a convenient way to adopt healthy habits that align with his goal of having a healthy and environmentally conscious lifestyle.','We know more than one-third of U.S. adults are obese. The Journal of Neuroscience finds that the constant struggle to make healthy choices is not a question of will, but of overcoming unhealthy thoughts. These unhealthy decisions do not end at our food, but extend into the products in our homes and in our garbage. From this, we see that young adults buy what is convenient and familiar which lead to unhealthy choices.','Adults now check their phones more than 1,500 times a week. This makes applications an easy way to engage the consumer. Therefore the need for a wellness based rewards application is very real. Our application does just that by tracking healthy habits. If the user has a fitness tracking device, completes a daily workout, checks-in at their gym, or purchases athletic merchandise the user receives fitness points. If the user purchases featured meals or purchases healthy food options they receive food reward points. If the user purchases an environmentally friendly product from Target or attends a sponsored volunteer event they receive environment reward points. These points roll up to total wellness points, which can be redeemed for gift cards and other promotional wellness rewards. The use of this application promotes healthy choices through positive reinforcement, which helps develop and maintain healthy habits.','Challenge2,TargetWellness','jacob.mchenry@target.com,david.e.ramirez@target.com,rebeca.murguia@target.com','',0,0,0,'2015-02-06 09:56:43','2015-02-06 09:56:43',0,1,4),(34,0,'Target Lifestyle','Wellness for people can mean many different things but at its core people want to live a healthy life. There are endless options for people to choose from but they have trouble finding motivation, the right type of activities, healthy food alternatives and they lack time to figure it all out alone. With Target Lifestyle, Target will help you learn more about yourself, help make the best choices to live a healthy life that fits your style! Target will be the partner everyone needs in their wellness journey. <br />\r\nTake Jackie, she is an active and social individual who isnâ€™t a traditional gym goer that needs help finding undiscovered way to continue her journey living well and eating healthy. She is bored with her routine and lacks the knowledge and time to do something that feels more fulfilling. With Target Lifestyle, she is given activities tailored to her interests and tips to keep her wellness journey fresh. First using the wellness quiz she, is given activities that fit her lifestyle and preferences.  It then connects her to products and grocery items with meal recipes that will make her life easier.  Creating a community is also a large part, Target will host special wellness events around the city that will bring her and people like her together.','People love to gain knowledge on how to live a healthy life, have their plan flow fluidly, and enjoy each day. We will do this by:<br />\r\nâ€¢	Streamlining what they like with a quiz and giving them activities that align to their preferences<br />\r\nâ€¢	Provide them with products and recipes that will make what they love to do easier<br />\r\nâ€¢	Create a central location for people to share their inspiration, wellness parties ideas, and connect with other people <br />\r\nâ€¢	Allows Target to be a partner in their wellness journey by hosting Target Lifestyle events to create a community and bring people together: Roller Rally, Yoga in the Park, Target Chef Class, Live Well with Target','Consumers will create a profile which will start with the quiz and begin their journey. Their profile/dashboard will lead them to activities they love, products + coupons they will need to make their lives easier, and link them to the Target Lifestyle social network that connects them to people like them.','wellness,challenge1','Lauren Woodie,Adriana McKenzie,Kelli Lehmann','',4,30,1.81651,'2015-02-06 10:02:18','2015-02-06 10:02:18',1,1,121),(35,153,'Target Healthy Meal Solutions','Meet Molly.  Molly is a 30 something working mom who struggles to find the time and motivation to cook nutritious, good tasting meals that her family will actually eat.  She dreads weekend grocery shopping with her children and feels defeated and guilty when she resorts to fast food meals for convenience.','To the Target guest, a key component of wellness is healthy eating.  Yet, guest insights show us that all segments struggle with eating well consistently, citing motivation and time as the biggest barriers. There is currently not a solution in the marketplace that addresses the time suck of recipe searching and grocery shopping that includes a subscription service with predictive user level customization(like Netflix), nutritional tracking over time, the power of Target\'s whole store assortment, all while providing ongoing motivation to cook healthy.','Target Healthy Meal solutions helps eliminate the time associated with finding recipes and shopping for ingredients, while providing ongoing motivation to make healthy choices through online networks.<br /><br />\r\nMolly simply creates a profile one time by choosing how frequently recipes will be pushed, her dietary preferences: protein, allergies, low fat, etc , delivery preferences and order frequency.  Target will match those selections with curated recipes featuring recipes from our merch partners, like Rachael Ray and our inner circle blogging partners, such as Skinnytaste.  Per Mollyâ€™s designated cadence, Target will push relevant recipes to her.  Recipes will feature ingredients from made to matter and Target owned brand products. Target will also link cartwheel offers related to ingredients.  Molly\'s homepage will also track dollars saved per recipe and total savings per year.<br /><br />\r\nRecipes are reviewed by other community members of Target Healthy Meal Solutions and nutritional info is clearly posted on each recipe.  Instructional video clips accompany recipes.<br /><br />\r\nMolly can select all recipe ingredients to be added to her virtual cart, or deselect ingredients that she already has at home.  Groceries will be available for delivery or in store pick up.<br /><br />\r\nFinally Molly can join networks specific to her needs.  If she is interested in connecting with others about picky eaters and weight loss, so can join these networks to share tips and tricks.  This will help motivate her to continue with healthy meal choices.','challengetwo, wellness, fastfoodnomore, healthymealsolutions, dinnerhero','kathryn.tyner@target.com,byron.young@target.com','',0,0,0,'2015-02-06 10:12:52','2015-02-06 10:19:00',0,1,8),(36,133,'Target To Table - Easy Dinner Brought to Your Car','Whatâ€™s for dinner?<br /><br />\r\nEvery day, this simple question strikes a lightning rod of stress and guilt into the heart of a working parent.Target To Table gives our guest a chance to make a healthy, yummy dinner at home without the hassle of planning, shopping or doing too much cooking. <br />\r\nMeet Emily - She knows that her kids need fresh, healthy food. She knows about the studies- kids who eat dinner with their family at home get better grades and are less likely to do drugs.  She wants that happy life for her kids more than she wants happiness for herself, she plans family vacations months in advance and drives across town for swimming lessons in a heated salt water pool, yet there never seems to be time to plan for a healthy dinner she can feel proud of.<br />\r\nNearly every night Emily feels like the worst mom in the world, as she orders pizza or Bite Squad, or pulls into DQ for chicken fingers.  She wants to change, she wants to give her kids great food every night but just doesnâ€™t have the time to think ahead to plan and cook healthy dinners.<br />\r\n<br />','Moms and dads both work, according to the Bureau of Labor 59% of families with kids have two working parents which means that no one is home thinking about dinner on a weekday afternoon. Kids are in more organized activities than ever before and it all adds up to families spending less time eating together. According to NYU Langone Medical Center, family dinners have decreased 28% over the last 20 years.<br /><br />\r\n  â€¢Target has found that itâ€™s not just burnt out parents like Emily,     but  ALL guest segments struggle with eating well and want to improve. <br /><br />\r\n  â€¢ Plated, Freshology, HelloFresh and HomeChef can bring you ingredients for dinner, but they are expensive, charge for delivery and require a few days of advance notice.  They canâ€™t help when you need dinner TONIGHT.','Target To Table is seamless and easy.<br />\r\n1.	The guest orders a dinner from an app on her phone, or online at her desk at work.<br />\r\nOn Tuesday at 3 pm she can select a healthy (and yummy) meal from a list of options and select a time to get it.<br /><br />\r\n2.	Everything needed for dinner is in one bag that is delivered to the guest at home --  or walked out to the guestâ€™s car in the Target parking lot -- or picked up in store â€“ the guest decides and Target makes it happen<br /><br />\r\nThe Target To Table bag is filled with pre-measured ingredients and easy to follow instructions on what to do with them. Parents serve the dinner on their own  plates, kids donâ€™t even realize that mom or dad uses Target To Table, they just know that dinner is yummy and they feel good.','challengetwo,TargetToTable,BullseyeCrowd','kimberly.wells@target.com,juliea.swenson@target.com','https://www.youtube.com/watch?v=V9GFgTGus0s',36,158,2.74766,'2015-02-06 10:22:39','2015-02-06 10:42:49',1,1,826),(37,296,'Target Wellness App','Sam is a 24 year old young professional who moved to a new city and is establishing their new identity. Sam came from a home that did not value healthy habits, but he now values the idea of being healthy. Sam wants to be healthy and environmentally conscious but does not know how to start, nor has the time, inspiration, or resources. Sam needs a convenient way to adopt healthy habits that align with his goal of having a healthy and eco-friendly lifestyle.','We know more than one-third of U.S. adults are obese. The Journal of Neuroscience finds that the constant struggle to make healthy choices is not a question of will, but of overcoming unhealthy thoughts. These unhealthy decisions do not end at our food, but extend into the products in our homes and in our garbage. From this, we see that young adults buy what is convenient and familiar which lead to unhealthy choices.','Adults now check their phones more than 1,500 times a week. This makes applications an easy way to engage the consumer. Therefore the need for a wellness based rewards application is very real. Our application does just that by tracking healthy habits. If the user has a fitness tracking device, completes a daily workout, checks-in at their gym, or purchases athletic merchandise the user receives fitness points. If the user purchases featured meals or purchases healthy food options they receive food reward points. If the user purchases an environmentally friendly product from Target or attends a sponsored volunteer event they receive environment reward points. These points roll up to total wellness points, which can be redeemed for gift cards and other promotional wellness rewards. The use of this application promotes healthy choices through positive reinforcement, which helps develop and maintain healthy habits.<br /><br /><br />\r\n***Access to Video: Crowd*** (with capital C)','challenge2,targetwellness,food,fitness,environment,volunteer,wellness,bullseyecrowd','jacob.mchenry@target.com,david.e.ramirez@target.com,rebeca.murguia@target.com','http://vimeo.com/118953911',5,33,2.01356,'2015-02-06 10:39:46','2015-02-06 10:46:40',1,1,202),(38,348,'Meal Planning Made Easy!','Lack of time within our busy lifestyles and costs for organic, whole foods can be a contributing factor in making poor food choices. Additionally, meal preparation is time consuming and can be costly. A meal preparation app can minimizes preparation, organization and time to plan and execute healthy meals each week for individuals and their families while also providing a seamless guest experience, healthy products and options!','After connecting with five individuals to discuss them and their familyâ€™s well-being goals, all five mentioned eating healthy as a key goal, but that time, planning and organization were key barriers in achieving this wellness goal. Three of the five also mentioned that they would like to experiment with new â€œhealthierâ€ recipes that their families would enjoy.','Create a meal planning app that aggregates and organizes recipes into a shopping list and/or offers curb-side pick-up to minimize time, organization and hassle of healthy meal planning and preparation: <br />\r\n1.	The user fills out a profile when getting started that share any healthy eating preferences / goals and dietary restrictions (gluten-free, lactose free, all organic, grass-fed meats, etc.), etc. <br />\r\na.	The user can also set default brands, Target store locations, manage their pantry inventory, add payment information, etc.<br />\r\nb.	It would be a bonus if Target could also offer local community-supported agricultural program that the guest could opt into as a part of this program<br />\r\nc.	The profile can also ask the guest if they want suggestions on recipes based on searches, healthier swaps for ingredients or freshness dates and reminders on purchases<br />\r\nd.	The profile can also hold payment options, such as their Target red card, Apple Pay / CurrentC, or Target.com profile<br />\r\n2.	The app allows individuals to upload pictures of recipes, integrates with social media sites (such as Pinterest or common recipe apps to gain access to the recipes that the user wants to make) or offers a recipe catalog the user can search and select from<br />\r\na.	Recipe catalog can be sorted many different ways, by ingredients, prep time, top rated, health index, gluten free, kid preferred, etc. <br />\r\nb.	It also could allow you to send recipes to friends, roommates or significant others or share via social media <br />\r\n3.	The user can finalize the shopping list after it is aggregated to:<br />\r\na.	Remove items they currently have (i.e. I already have olive oil, spices, etc) in your pantry <br />\r\nb.	Add other Target items into the list for ease of shopping at this time <br />\r\nc.	Confirms size /quantities based on recipes (maybe we can have metrics on the back end to make a suggestions)<br />\r\n4.	The user can also select how the recipe ingredients should be aggregated for delivery <br />\r\na.	The app can sort into a shopping list by aisle (maybe at some point weâ€™d have beacon technology to show the guest where the ingredient is in relation to where they are in the store). <br />\r\ni.	The list should also be able to be exported to text or email to send to a significant other or partner, roommate for pick-up<br />\r\nii.	The list can also sync and be updated real-time so that partners/roommates can add/delete or change throughout the day and the guest has the most updated list<br />\r\nb.	The app offers a pick-up curb side option for those in a hurry but want to  prepare a healthy meal<br />\r\ni.	The guest can select a 30 minute window for in-store pick-up <br />\r\nc.	Maybe one-day we could even deliver or acquire a grocery delivery company! <br />\r\n5.	The app will also search Cartwheel and manufacturerâ€™s coupons to deliver value and deals to the consumer <br />\r\n6.	The guest then selects payment option already stored in profile and clicks â€œdoneâ€','Challengetwo ,eatwell, digitallyconnected','','',2,34,2.28261,'2015-02-06 10:44:56','2015-02-06 10:44:56',1,1,186),(39,72,'Healthy Kids Licensed Meal','**** WATCH OUR VIDEO: https://vimeo.com/118965884 ***<br /><br /><br />\r\n<br /><br /><br />\r\nWellness Wendy is motivated to help her family eat well, but her kids refuse when she tries to serve them healthy alternatives. Our concept associates popular kidsâ€™ brands/characters with healthy foods to increase consumption and remove the guilt that is experienced when she is forced to serve less healthy options. These popular brands/characters possess the highest level of credibility with kids, and our concept lends â€œmagical powersâ€ to Wendy during mealtime.','Kids are picky and they have a preference for unhealthy foods. Licensed products today are typically associated with snacks, candy, and treats. Parents we interviewed have tried providing healthy alternatives, with no success based on refusal. In our interviews, we also heard that having to deal with push back makes the meal process a more time-intensive one, causing additional stress.<br /><br /><br />\r\n<br /><br /><br />\r\nBased on research from NPD Group, we know that 58% of parents say that their childrenâ€™s adoration for a particular brand or character influences their preference in toys, games, decorative, etc. In that same survey, 37% said a byproduct of that adoration is it â€œbrings the funâ€ to any item associated. Furthermore, the survey stated a childâ€™s affinity for certain brands/characters helps make the lives of those around them a bit easier.<br /><br /><br />\r\n<br /><br /><br />\r\nBased on Guests Insights research, 40% of consumers made license product purchases in the last 3 months with Grocery making up the 3rd largest pyramid for license purchases behind Hardlines & Apparel.','1.	While shopping at Target, online or in-store, the product catches the Guestsâ€™ eye.<br /><br /><br />\r\n<br /><br /><br />\r\n2.	Identified as a trusted licensed-solution for a quick, HEALTHY meal, sheâ€™s intrigued.<br /><br /><br />\r\n<br /><br /><br />\r\na.	UNIQUE TWIST: Featuring cauliflower as an ingredient, she notices the association with Frozen by renaming cauliflower, â€œElsaâ€™s Ice Treesâ€.<br /><br /><br />\r\n<br /><br /><br />\r\nb.	TIME: She also clearly understands the time necessary to prepare the meal with a clear callout on the packaging.<br /><br /><br />\r\n<br /><br /><br />\r\nc.	DISTRACTION: Equal in length to cooking time, exclusive-digital video content is provided to â€œentertainâ€ her kids while preparing the meal, and help her kids continue the magical journey, overcoming their dislike of healthy foods. Mom will see this as a temporary baby-sitter, freeing up time to focus on the meal.','Wellness,Challenge1,pickykids,healthyoptions,easy,disney,licensed','jamison.arends@target.com,ben.feldman@target.com,garry.marshall@target.com,fadi.zain@target.com','https://vimeo.com/118965884',9,73,2.87552,'2015-02-06 11:59:11','2015-02-11 10:52:36',1,1,279),(40,153,'Healthy Meal Solutions','Please view video: https://vimeo.com/118962135  password \"crowd\"<br /><br />\r\nMeet Molly. Molly is a 30 something working mom who struggles to find the time and motivation to cook nutritious, good tasting meals that her family will actually eat. She dreads weekend grocery shopping with her children and feels defeated and guilty when she resorts to fast food meals for convenience.','To the Target guest, a key component of wellness is healthy eating. Yet, guest insights show us that all segments struggle with eating well consistently, citing motivation and time as the biggest barriers. There is currently not a solution in the marketplace that addresses the time suck of recipe searching and grocery shopping that includes a subscription service with predictive user level customization(like Netflix), nutritional tracking over time, the power of Target\'s whole store assortment, all while providing ongoing motivation to cook healthy.','Target Healthy Meal solutions helps eliminate the time associated with finding recipes and shopping for ingredients, while providing ongoing motivation to make healthy choices through online networks.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nMolly simply creates a profile one time by choosing how frequently recipes will be pushed, her dietary preferences: protein, allergies, low fat, etc , delivery preferences and order frequency. Target will match those selections with curated recipes featuring recipes from our merch partners, like Rachael Ray and our inner circle blogging partners, such as Skinnytaste. Per Mollyâ€™s designated cadence, Target will push relevant recipes to her. Recipes will feature ingredients from made to matter and Target owned brand products. Target will also link cartwheel offers related to ingredients. Molly\'s homepage will also track dollars saved per recipe and total savings per year.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nRecipes are reviewed by other community members of Target Healthy Meal Solutions and nutritional info is clearly posted on each recipe. Instructional video clips accompany recipes.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nMolly can select all recipe ingredients to be added to her virtual cart, or deselect ingredients that she already has at home. Groceries will be available for delivery or in store pick up.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nFinally Molly can join networks specific to her needs. If she is interested in connecting with others about picky eaters and weight loss, so can join these networks to share tips and tricks. This will help motivate her to continue with healthy meal choices.','dinnerhero,challengetwo,wellness,fastfoodnomore,healthymealsolutions,challenge2,timesaver','kathryn.tyner@target.com,byron.young@target.com','https://vimeo.com/118962135',6,53,2.82857,'2015-02-07 01:54:49','2015-02-13 04:18:44',1,1,255),(41,362,'Hello. Healthy.  Fresh Organic Meal Options','Consumer research indicates that while guestsâ€”and especially Millennialsâ€”care about eating fresh, healthy, organic meals, they lack the ability, inspiration and time to make planning, shopping for and preparing meals a daily priority.  Guests increasingly look to their primary grocery to help navigate food-based wellness and as a resource for outsourcing meal preparation.  Retailers who are successful in fulfilling this need experience an uplift in their credibility as a trusted wellness source across assortments.','The Food Marketing Instituteâ€™s U.S. Grocery Shopping Trends 2014 and Targetâ€™s Guest Insights support  our concept.<br /><br /><br /><br /><br />\r\nâ€¢	Millenials look to grocery as a viable option for cooking outsourcing.  For Millenials, top drivers of grocer-prepared food consumption include cheaper prepared foods (55%) and better quality prepared foods (52%).<br /><br /><br /><br /><br />\r\nâ€¢	Millenials value cooking from scratch, but only 34% feel they have the knowledge to do it well, often with reliance on â€œassemblyâ€ cooking.<br /><br /><br /><br /><br />\r\nâ€¢	Planned eating/shopping made way for immediate and same-day consumption.  Immediate consumption is no longer relegated to snacks and planned restaurant meals; itâ€™s now a normal part of food management.  25% of all meals consumed by tweny-somethings include items purchased the same day.<br /><br /><br /><br /><br />\r\nâ€¢	Health and well-being, including how foods are made/sourced and their nutritional content, have emerged as one fo the central guiding principles of todayâ€™s eating culture.  Consumers  shop for foods that satisfy multiple health attributes focusing on good fiber, avoidance of negative ingredients (sugar, sodium, preservatives), minimal processing, heart health and positive nutrition.<br /><br /><br /><br /><br />\r\nâ€¢	Consumers increasingly look to food retailers to become trusted allies in helping shoppers navigate food and wellness.  43% of consumers cited their primary food store as the source to help them stay healthy, beating health insurance companies (26%), government institutions (20%), the media (20%) and celebrity chefs (14%).<br /><br /><br /><br /><br />\r\nâ€¢	Securing consumer trust in the health attributes of a retailers grocery attributes correlates with consumers having the greatest trust in their store as a wellness ally.','Guests will experience the Hello Healthy meal program as follows:<br /><br /><br />\r\n<br /><br /><br />\r\n1.	In partnership with a trusted media source for nutrition information, such as Cooking Light, Target will assemble the ingredients needed to create healthy, chef-driven and dietitian-reviewed meals focused on wellness brands, healthier ingredients (lower fat, higher fiber, lower sodium, etc.) and organics.  Recipes will be culled from Cooking Lightâ€™s monthly magazine selection, lending trust and legitimacy to Targetâ€™s nutrition claims while affording great opportunities for cross promotion (in store, in magazine).<br /><br /><br />\r\n<br /><br /><br />\r\n2.	Using an online digital/mobile platform, guests will enter their meal preferences including the number and frequency of meals theyâ€™d like to receive, any dietary restrictions and preferences, the size of their family, and their preferred fulfillment option.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n3.	At the frequency requested by the guest, Target will assemble pre-portioned ingredients and easy-to-follow meal assembly instructions for the guest to prepare at home.  Guests can pick up their weekly meal boxes in store or have them delivered to their homes.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n4.	Upon receipt of their boxes, guests can quickly and easily assemble fresh, home-cooked meals for their families, confident that the recipes and ingredients are healthy and that the meals will inspire their families to eat well.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\n5.	For guests on the go, Target will offer an alternate option to these assemble-at-home boxes.  Instead, guests can alternately purchase ready-to-eat, warm meal options to go from a transformed, health-focused Food Avenue.  Replacing the many unhealthy options currently available at Food Avenue will simultaneously lend credibility to Targetâ€™s wellness platform.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nOther Considerations:<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nâ€¢	Target could promote Hello Healthy through celebrity chefs and dietitiansâ€”our partners or Cooking Lightâ€™sâ€”lending further legitimacy to the mealsâ€™ health claims while generating inspiration and excitement<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nâ€¢	Target could partner with small growers to include locally sourced foods in their boxes, building on consumer enthusiasm for CSA shares, but without the hassles of time-consuming preparation<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nâ€¢	Target could leverage Hello Healthy meal boxes to introduce guests to other wellness products from assortments beyond grocery: personal care, beauty, household chemicals, etc.<br /><br /><br /><br />\r\n<br /><br /><br /><br />\r\nâ€¢	If successful, Target could expand the program to focus on other kinds of meals: breakfasts, lunches, dinner parties, etc.','healthymeals,organics,savetime','craig.seacotte@target.com,erin.ostlund@target.com,liz.brennhofer@target.com,katherine.mohan@target.com,april.gehler@target.com,jennifer.higgins@target.com','http://youtu.be/ron99xzeMeY',13,71,2.39224,'2015-02-09 02:15:53','2015-02-09 02:58:31',1,1,305),(42,337,'Be Well - Wellness App integrated within Target Healthful','Video Link: https://vimeo.com/119090949<br />\r\npw: crowd<br />\r\n<br />\r\nEveryone wants to be their best version of â€œwell.â€  But what does well mean?  For some being well may be eating better and getting to the gym if they havenâ€™t been there for a while.  For others it may mean being civic-minded and volunteering at their local shelter or donating extra clothes they have around their house.  Since being well means something different to everyone, providing a cookie-cutter, one-size-fits-all wellness plan doesnâ€™t work.  People want to make their own wellness choices based on whatâ€™s most important to them and fits into their busy lifestyles.  They just need a little help.','In doing research with various friends and families, it became clear that wellness highly varied from person to person. An individualsâ€™ passion for a wellness initiative highly varied, and for ones they weren\'t passionate about, they didn\'t want to be reminded they weren\'t taking part. This exposed the need for a wellness app that was customizable and relevant to them. When asked how Target can help them choose a wellness lifestyle, the common theme was asking for Target to reward or incent them to choose a wellness lifestyle.','Consumers will open the Target Healthful app which they already know and love for helping them manage their Target prescriptions. Be Well, the Wellness side of the Target Healthful App, will let the guest customize what Wellness initiatives will help them Be Well, while encouraging them to maintain that lifestyle. Whether itâ€™s connecting them with volunteering events, offering them rewards for completing fitness challenges, providing additional incentives to shop healthy, or helping them discover sustainable products at Target, Be Well will promote an encouraging and relevant way for our guest to live a wellness lifestyle. Be Well doesn\'t try to replace their fitness app or be some super all encompassing wellness app. It simply makes wellness fun and easy by offering incentives to choose a wellness lifestyle relevant to them.','wellness,bewell,challenge2','','https://vimeo.com/119090949',19,103,2.9169,'2015-02-09 02:53:09','2015-02-09 03:19:45',1,1,598),(43,51,'[Project Title] TBD Hope you like the concept anyway','Riley, our tech-savvy digitally connected guest, knows what he needs to do to be healthy. He is up on wellness trends and knows that he wants to have a better balanced lifestyle. Unfortunately, Riley doesnâ€™t have a way to get there. When he is faced with tough choices, Riley doesnâ€™t always have the time or energy to make the best decision. Often times his decisions donâ€™t line up with his aspirational goals.<br />\r\nHe needs a way to believe that a healthy lifestyle is attainable, but feels discouraged in the face of past failures and the perceived time and effort necessary to make sustained lifestyle changes.','Too many times we have seen friends, family, or ourselves go on the yo-yo wellness phases. First we start off so excited to get into a better lifestyle, but then the inevitable happens. We become discouraged and give up. The time and effort needed to log your â€œpointsâ€, track your â€œactivitiesâ€, buy and prepare your food, etc. is way too much and doesnâ€™t seem even possible to become a sustainable lifestyle.','â€¢ Low Effortâ€”providing analytics on their behavior to better inform choices<br />\r\nâ€¢ Consistent and Accountableâ€”regular communication and reference point for benchmarking progress<br />\r\nâ€¢ Personalizedâ€”what are your wellness goals? Are your goals â€œorganic only kitchenâ€, â€œbleach-free householdâ€, â€œall natural beautyâ€?<br />\r\nâ€¢ Integratedâ€”online experience linked with your existing Target accounts (cartwheel, lists, recipes), in-store experience to help you make decisions in aisle, personalized recommendations based on your shopping patterns<br />\r\nâ€¢ Rewards-- incentives to continue with progress via personalized coupons, tips and tricks to keep you on track<br />\r\nAfter Riley signs up for [Project Title], he receives a bi-weekly email summarizing his shopping patterns. He can see how much of his purchases qualify as wellness compared to non-wellness items. Wellness is predefined as â€œorganicâ€, but Riley wants to take his wellness journey one step further. He can log into his account and personalize his settings to align with his vegan lifestyle change. This way, now his wellness tracker will reward him only for his vegan purchases, and help him make decisions that align with his lifestyle choice. When he goes back to the store, Riley is confronted with difficult decisions in the soup aisleâ€¦ he canâ€™t tell which soups are vegan. He pulls out his phone and is able to scan the item to make sure that it qualifies for his wellness tracker. He continues to have difficult decisions in the cleaning aisle and skin care aisle, but his phone helps him make the right decision immediately so he doesnâ€™t have to stress.<br />\r\nOver time, Riley gets suggestions sent to him on easy product swaps and recipe suggestions. He used to only buy rice, but was suggested to try quinoa and now he loves it! He also gets suggestions on easy recipes based on products he has bought in the past couple weeks so that he can live his desired lifestyle the easiest way possible. He can see his progress over time on his profile and gets additional coupons as he improves.<br />\r\n*Sorry, we couldnâ€™t figure out how to add audio to our video. Best experience is when listening to https://www.youtube.com/watch?v=-i5MU14JLdw','ChallengeTwo,Tellusatitle,MeetRiley,Scrappy','cory.d.williams@target.com,caitlin.connolly@target.com','https://vimeo.com/118966087',8,62,1.90521,'2015-02-09 03:22:07','2015-02-09 09:24:21',1,1,344),(44,59,'Vitamin Deficiency Status and Solution','Our guests love vitamins and they know that their bodies aren\'t getting enough. The problem is they don\'t know what they\'re lacking in or what would help them lead healthier lives. So what if we could help them identify their deficiencies and direct them to the Target solution?','Stand in the vitamin aisle at Target and observe the blank faces of our guests as they try to figure out if they should buy some Vitamin A, D, C, B12, B9, or B5. Or maybe they just need a tablespoon of magnesium? Let\'s help them out.','Non-invasive technology is becoming available (www.vitastiq.com) that can test your vitamin and mineral levels with just a swipe across your skin. Similar to blood-pressure monitors in drug stores, Target can offer an elegant in-store test for our guests. This allows Target to become a partner in wellness and drive sales in the vitamin aisle. One feature could be a color-coded system in the aisle. If the test displays you\'re low in B12 (Light Blue) the vitamin jar in store can be light blue.','wellness,vitamins','','',19,74,1.92,'2015-02-09 09:40:11','2015-02-09 09:40:46',1,1,260),(45,62,'Recipes','â€¢ Not knowing what to cook<br />\r\nâ€¢ Not knowing the nutrition of meal options<br />\r\nâ€¢ Not having time to plan healthy meals<br />\r\nâ€¢ Not having time to convert recipes into shopping lists <br />\r\nâ€¢ Not knowing where products are located<br />\r\nâ€¢ Not knowing if recipe ingredients are discounted on Cartwheel','â€¢ Need to search through different recipes or Pinterest boards while shopping<br />\r\nâ€¢ Need to manually convert ingredients into a shopping list <br />\r\nâ€¢ Forget to click on recipes or buy key ingredients<br />\r\nâ€¢ Not knowing which product is recommended<br />\r\nâ€¢ Not finding product or having to go back through the same isle again<br />\r\nâ€¢ Not knowing what to cook leads to eating unhealthily or going out to eat<br />\r\nâ€¢ Not having the resources or suggestions in the moment while shopping','Minimal Viable Product (MVP):<br />\r\nâ€¢ Integrate Target Recipes into the Target App â€“ Search for recipes  <br />\r\nâ€¢ Filter Recipes â€“ Based on type of cuisine, meal, cook time, diet, trend, or ingredients<br />\r\nâ€¢ Import Pinterest boards â€“ Creates ingredient lists from keywords in description<br />\r\nâ€¢ Listâ€“ Add ingredients to shopping list or cart <br />\r\nâ€¢ Maps, Paths, and Ship to Home â€“ Utilize Target Appâ€™s current and future features <br />\r\nâ€¢ Personalized Settings â€“ Setup family size, save favorites, and enter allergies  <br />\r\nâ€¢ Meal Calendar â€“ Create your own meal plans or pick from recommendations<br />\r\nâ€¢ Share â€“ Invite friends to see shopping lists, favorites, calendars, or sync to Pinterest<br />\r\n<br />\r\nFuture Scope:<br />\r\nâ€¢ Flexible Fulfillment â€“ Home delivery for groceries <br />\r\nâ€¢ Curbside Pickup â€“ Get your order when you pull up to Target<br />\r\nâ€¢ Cartwheel â€“ Recommend similar ingredients that are on promotion','challengeone','','',6,51,2.55083,'2015-02-11 02:17:45','2015-02-11 02:17:45',1,1,178),(46,230,'Get Better Kits','Here\'s the deal.  You\'re a busy Mom/Dad and little Charlie is sick.  Not sick enough to go to the doctor or clinic, but just miserable enough to need something to ease some of the symptoms.','It\'s all subjective and unquantifiable, but any parent can relate to the tension and stress that comes with having a sick kiddo at home.  Anything to make that easier would be a welcome idea.','It\'s easy.  Mom/Dad simply logon to Target.com.  From a protal they enter their child\'s symptoms, any allergies, etc.  This information is sent to a nearby store pharmacy (or clinic) and the pharmacist (or practitioner) looks at the symptoms and picks out over-the-counter products that they personally recommend and should help poor Charlie out.  These items are packed in branded \'Get Better\' kits along with a personalized note (to Charlie) from the pharmacist (or clinician) with the pharmacy (or clinic) phone number (in case Mom/Dad have any questions).  The kit is ready to be sent to the service desk.  Mom/Dad are then alrerted and they can swing by Target to pick up their kit.  In a flash they are back home and little Charlie gets a healthy dose of Target care, service and support.','sick,kids,wellness,otc,pharmacy,clinic','','',10,47,1.87952,'2015-02-11 06:08:08','2015-02-11 06:26:55',1,1,150),(47,230,'Target Rx Tracker','Guests do not know the status of their prescription while waiting.  We send text alerts, but guests still check back at the pharmacy to see if it is ready.  This creates congestion around the pharmacy and lines appear unorganized and haphazard.  We do a good job of letting guests know when their prescription is ready, but not a good job letting them know the status along the way, especially if there is an issue that may cause a delay (insurance error, have to call doctor)','Guest insights data has shown us that customers only like to stop by the pharmacy once, not to check-in, check back and then come back to pick-up/pay.  A majority will also come back 5-10 minutes earlier then when we promised their prescriptions would be ready.  Guests perceive the lines to be longer than they are and that the pharmacy team is disorganized.','Take the Domino\'s pizza tracker as a base line.  We start by letting you know we received your prescription (no more checking in at the pharmacy when your doc has submitted an electronic prescription just to see if we got it).  Then we will let you know if it is being processed/filled; also letting you know if anything has come up that is causing a delay.  Finally we will let you know when the pharmacist has checked it and it is ready to be picked up.  We will keep you \'in-the-know\' the entire way.  No need to check-in with us.  We would also integrate an online pay system to make the checkout process even faster and easier.','prescription,pharmacy,wellness,bewell','','',23,73,2.87705,'2015-02-11 07:01:22','2015-02-11 09:12:05',1,1,243),(48,1248,'Green Dry Cleaner @ Target','Consumer Problem: Consumers do not have a convenient way to get their clothing dry cleaned in an environmentally friendly, sustainable manner.<br />\r\n<br />\r\nTarget Problem: Target is looking to drive additional traffic by providing a product or service that guests desire and strengthens the link to our brandâ€™s wellness initiative.<br />\r\n<br />\r\nConcept: Create a green, one-hour dry cleaning service that allows guests the opportunity to complete their weekly shopping trip while taking care of their laundry.','Reasons to Believe:<br />\r\n- Affordable, environmentally-friendly dry cleaning services are difficult to find and inconvenient<br />\r\n- The guest with a dry-cleaning need is affluent.<br />\r\n- The guest who needs dry-cleaning uses the service on a routine basis, driving regular trips.<br />\r\n- The guest who uses Target as their Dry Cleaning destination will either comeâ€¦<br />\r\n  â€¦twice a week, once to drop-off and once to pick-up.<br />\r\n  â€¦once a week, shopping Target for one-hour until Dry Cleaning is complete','- Green-friendly, best-in-class Dry Cleaning Service with a brand name that over-indexes at Target and with a service that has yet to be linked to a retailer (e.g., opportunity to brand or co-brand). Link with top green name like 7th Generation or Method and create brand hub in the same way Tide Dry Cleaning Services are rolling out throughout the country<br />\r\n- Create pick-up/drop-off at the top 200 ship-from-store locations<br />\r\n     - Allows for efficient drop off/pick-up of dry cleaning & ship-to-store Target merchandise<br />\r\n     - Quick, drive-through opportunity for ship-from-store coordination with USPS/UPS/Fedex<br />\r\n     - Opportunity to bundle with task-rabbit or other third-party delivery service to provide dry cleaning & Target products all-in-one car load (economies of scale).<br />\r\n     - Target to launch personalized, delivery-from-store car service or off-hours Uber trip that provides guests their full needs at a discount price. Example: Ship from store to your house in one-day for $10 if youâ€™re within 10 miles.<br />\r\n     - Pricing: Loss leader or competitive pricing to drive trips to the store.','dry cleaner,green,cleaning,cleaners,dry,wellness,trip driver,basket','','',21,57,1.89305,'2015-02-12 05:06:30','2015-02-12 05:06:30',1,1,197);
